      "<p>The GN20CE-NS combines Takamine's compact but big-sounding NEX body style with solid-top construction and a proprietary electronics system to create a guitar that looks as good as it sounds.</p>\r\n<p>For players looking for a different sound, the GN20CE-NS pairs a solid cedar top with mahogany back and sides to produce a warm, detailed tone that works beautifully for a wide range of musical styles. The slim satin-finish mahogany neck and 12\"-radius rosewood fingerboard provide great feel and playability, while the onboard Takamine TP-4TD preamp system gives you a built-in tuner with three-band EQ and gain controls for excellent amplified performance and versatility.</p>\r\n<p>Other great features include a synthetic bone nut and split bridge saddle, rosewood headcap, pearloid dot inlays, chrome die-cast tuners, and an elegant Natural satin finish.</p>\r\n",
