    title: "",
    brandName: "Takamine",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The GD11MCE-NS is Takamine's great value dreadnought acoustic. Somehow at \r\nthis price point, they've managed to include a cutaway for easier higher fret \r\naccess and an excellent preamp for plug-in and play simplicity. Whether you are \r\npracticing at home or performing, this has a lot to offer.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>The Tone of Mahogany</h3>\r\n<p>The GD11MCE-NS is made entirely from laminated mahogany. This helps to give \r\nthe guitar a distinctively <strong>gorgeous appearance and a strong sound</strong> \r\nwhile keeping it a great value guitar. </p>\r\n<h3>Takamine Preamp</h3>\r\n<p>The Takamine electronics make open mic nights and recording easy. Just plug \r\nin and the high quality preamp will help you to&nbsp;<strong>sound your best</strong>&nbsp;no \r\nmatter where you are!</p>\r\n<h3>The Choice of Rock Stars</h3>\r\n<p>Takamine guitars are played by artists like Bruce Springsteen, Jon Bon Jovi, \r\nNancy Wilson and Garth Brooks. Many <strong>world-class professionals use \r\nTakamine</strong>, so you'll be in good company!</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Smooth cutaway</li>\r\n\t<li>Great electronics</li>\r\n\t<li>Excellent value for money</li>\r\n</ul>",
