    title: "",
    brandName: "Yamaha",
    description:
      "<p>The APX1000 is a high spec guitar near the top of the APX range. Made with a solid Spruce top and Flamed Maple back and sides, this designed-for-the-stage acoustic guitar adds some premium touches like ornate inlays, gold hardware and an upgraded SRT pickup and preamp designed to make the APX sound better than ever.</p>\r\n<p>The body shape is the same slim design as the rest of the range, with the special non-scalloped bracing in there to add dynamic range. The solid Spruce adds some extra zing and definition to the lively tone, a prefect base for the plugged in sound. </p>\r\n<p>Speaking of which, the electronics are now the upgraded System 63 SRT system with undersaddle piezo pickup. This system sounds more natural than ever with more control over your sound. The control panel allow you to access a 3 band EQ, tuner, volume, ‘mic’ type (modelled simulations), Focus-wide, resonance and blend: rather comprehensive! This proves how much Yamaha have aimed this guitar at performers because these are controls you’d always rather have than your sound engineer!</p>\r\n<p>With it’s quality electronics and construction together with its solid top and upmarket looks, the APX1000 is a winner. This APX1000 is finished in Pearl Snow White.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
