    title: "",
    brandName: "Yamaha",
    description: "",
    productDetail:
      "<p>The 700 series guitars feature styling and specification driven by the 1000-series guitars but with the exclusive ART pickup system. Designed to capture the guitar’s full body resonance, ART’s ability to faithfully recreate natural tone and dynamics means that the subtle differences between APX and CPX guitars are perfectly recreated, allowing you to pick the guitar that suits your style and know that character will always shine through.</p>\r\n\r\n<h3>Body depth and Bracing pattern</h3>\r\n<p>The medium-jumbo body CPX delivers an open, modern tone with powerful, rich low-end, smooth, delicate highs, and sweet, open mids. Non-scalloped X-type bracing ensures a strong, rich acoustic tone that remains clear and well-defined on stage.</p>\r\n\r\n<h3>CPX Soundhole</h3>\r\n<p>CPX’s conventional round soundhole focuses the midrange, while controlling bass, for a direct, powerful sound.</p>\r\n\r\n<h3>ART System Pickup</h3>\r\n<p>A.R.T. pickup is designed with a multilayer structure consisting of six layers of different materials.</p>\r\n\r\n<p>Because the pickups are fitted directly beneath the top board and capture sound from both the guitar’s top and the air inside the body, the natural resonance of the guitar is faithfully reproduced.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n\r\n",
