    title: "",
    brandName: "Yamaha",
    description:
      "<p>Yamaha’s FG line has been in constant production since the mid 60s and is now something of a minor classic. Yamaha’s take on the dreadnought, the FG (presumably for Folk Guitar) is a great amalgamation of good design, excellent production standards and fantastic value for money.</p>\r\n<p>The FGX830C builds on the success of the FGX electro acoustic range by adding rosewood for the back & sides, creating a sound that has more harmonic content and a little less mid range. Strumming sounds more effective than ever as a result! A new scalloped bracing design increases sound and projection too. The System 66 piezo pickup system is in place to have you ready for the stage: the control panel includes a 3 band EQ and a tuner for on stage convenience. </p>\r\n<p>As well as the rosewood, the FGX830C enjoys some cosmetic upgrades that really enhance the guitar’s appearance: this has binding on the headstock, fingerboard and body (multi-ply binding on the body) and the soundhole rosette now has inlaid abalone, a beautiful touch! The FGX830C, available in Natural, is an excellent choice for the guitarist looking for an affordable all-rounder that looks and sounds great.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
