    title: "",
    brandName: "Yamaha",
    description:
      "<p>This unique looking guitar is from Yamaha’s SLG200 series of Silent guitars. Yes indeed: silent! Play anywhere at any time of the day or night with this original concept in guitars. Plug headphones in for private practice (with onboard FX!) or use it on stage as a feedback-free acoustic! The guitar itself makes next to no noise so you won’t have to worry about waking people up at three in the morning with your playing!</p>\r\n<p>The plugged-in sound uses Yamaha’s SRT pickup technology to make a completely convincing acoustic sound that will definitely satisfy demanding players with its authenticity. The body of course is very thin like an electric guitar (albeit one with most of its body wood missing!) and this can be partially dismantled for easy travelling.</p>\r\n<p>The onboard electronics include controls for bass, treble, vol, aux vol (you can plug your phone in to jam along with songs in your headphones!), two reverbs, a chorus and a tuner. These features increase the fun factor considerably!</p>\r\n<p>There are a variety of Silent Guitar models: this one is the steel string model which has a nice low action and a slim neck for unsurpassed playability.</p>\r\n<p>Whatever your home or travelling situation is, you can now get some real practice and enjoyment in with the SLG200.</p> \r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
