    skU_ID: "160406296792008",
    asn: "4957812607872",
    category: "GUAG_1",
    online: true,
    itemName: "LL-TA Transacoustic Dreadnought Vintage Tint",
    title: "",
    brandName: "Yamaha",
    description:
      "<p>Borrowing from their half-century of experience in making acoustic guitars, Yamaha offer an original design with their L series acoustics that held the traditional with the modern. With a feel that seems pre-played in and a fantastic new Zero Impact pickup and preamp system, the Yamaha L Series are a serious proposition indeed.</p>\r\n<p>This model is a Transacoustic guitar. This proprietary technology developed by Yamaha simulates, via an ‘actuator’ attached within the guitar to the back of the body, the natural reverb and chorus effects that occur when you play in an acoustically superb room. The idea is that the guitar just sounds much better in a natural way. This unit, powered by batteries, has a couple of controls to determine how much reverb and chorus you want in your sound. In practice, this sounds very convincing when set properly: there is an extra dimension to the sounds that really open up the sound and enliven your playing. It’s very unusual but in a great way!</p>\r\n<p>The guitar itself is very impressive, too: top quality Engelmann Spruce for the top and solid Rosewood for the back and sides makes for a classic combination that sounds fantastic. The top has been treated to Yamaha's A.R.E. process which simulates the sound of aged and played -in wood. The timber sounds more mature and enhances the overall playing experience further. An Ebony fingerboard brings extra class to proceedings.</p>\r\n<p>The Dreadnought body shape is a traditionally classic and sonically versatile choice: strumming and fingerpicking work equally well, especially with the Transacoustic technology in effect! The Zero Impact pickup system offers a new level of transparency for your live performances.</p>\r\n<p>This wonderful guitar is basically for any player who wants to experience inspiring sounds every time they pick up their guitar for a play.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
    productDetail:
      "There’s nothing so inspiring as playing guitar in a great sounding room – it makes you play better, longer and with more creativity. The Yamaha TransAcoustic Guitar recreates that incredible experience without needing any external amplification or effects, just the guitar itself. It’s the most inspiring acoustic guitar you’ve ever played.",
    salesPrice: 999.0,
    pictureMain:
      "https://images.guitarguitar.co.uk/cdn/large/130/160406296792008.jpg",
    qtyInStock: 7,
