    skU_ID: "160406296793008",
    asn: "4957812607896",
    category: "GUAG_1",
    online: true,
    itemName: "LL-TA Transacoustic Dreadnought Brown Sunburst",
    title: "",
    brandName: "Yamaha",
    description:
      "<p>Borrowing from their half-century of experience in making acoustic guitars, Yamaha offer an original design with their L series acoustics that held the traditional with the modern. With a feel that seems pre-played in and some ingenious new technology under the hood, the Yamaha L Series are a serious proposition indeed.</p>\r\n<p>This model is a Transacoustic guitar. This proprietary technology developed by Yamaha simulates, via an ‘actuator’ attached within the guitar to the back of the body, the natural reverb and chorus effects that occur when you play in an acoustically superb room. The idea is that the guitar just sounds much better in a natural way. This unit, powered by batteries, has a couple of controls to determine how much reverb and chorus you want in your sound. In practice, this sounds very convincing when set properly: there is an extra dimension to the sounds that really open up the sound and enliven your playing. It’s very unusual but in a great way!</p>\r\n<p>The guitar itself is very impressive, too: top quality Engelmann Spruce for the top and solid Rosewood for the back and sides makes for a classic combination that sounds fantastic. The top has been treated to Yamaha's A.R.E. process which simulates the sound of aged and played -in wood. The timber sounds more mature and enhances the overall playing experience further. </p>\r\n<p>Yamaha's Dreadnought body shape is a visually beautiful and sonically versatile choice: strumming and fingerpicking work equally well, especially with the Transacoustic technology in effect! It has slightly more rounded shoulders than typical dreadnoughts which adds to the beauty. The guitar has been finished in a beautiful Brown Sunburst.</p>\r\n<p>This wonderful guitar is basically for any player who wants to experience inspiring sounds every time they pick up their guitar for a play.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
    productDetail:
      '<p>There’s nothing so inspiring as playing guitar in a great sounding room – it makes you play better, longer and with more creativity. The Yamaha TransAcoustic Guitar recreates that incredible experience without needing any external amplification or effects, just the guitar itself. It’s the most inspiring acoustic guitar you’ve ever played.</p>\r\n\r\n<p><strong>Actuator<br /></strong><span class="s1">An actuator is installed on the inner surface of the guitar back vibrates in response to the vibrations of the strings. The vibrations of the actuator are then conveyed to the body of the guitar and to the air in and around the guitar body, generating authentic reverb and chorus sounds from inside the body.</span></p>\r\n<p><strong>Simple Controls</strong><br /><span class="s1">Three simple knobs let you adjust the degree of effect applied and the line-out volume level. Additionally, keeping the controls small minimizes the area of the holes in the body material, reducing acoustic sound loss</span></p>\r\n<p class="p1"><span class="s1"><strong>New Battery Box</strong><br />The battery box is integrated into the end-pin jack. This requires fewer holes in the body, thus reducing acoustic sound loss. Connect the cable from the jack to a PA or amp to use as an Electro-Acoustic Guitar.</span></p>\r\n<p class="p1"><span class="s1"><strong>Designed to Provide Superb Acoustic Guitar Sound</strong><br /></span><span class="s1">The body is an all-solid guitar based on the L-series. A modified non-scalloped bracing design enhances the low end with retaining the bright tone. Treating the tops with Yamaha’s exclusive A.R.E. process gives the instrument a rich, vintage quality tone. </span></p>    <h3>Yamaha Authorised Dealer</h3>  <p>guitarguitar proudly stock a wide range of Yamaha musical instruments and sell throughout the UK and the EU/EEA. We do not supply Yamaha musical instruments outwith the EEA </p>',
