    category: "GUAG_2",
    online: true,
    itemName: "APX700II 12 String Natural",
    title: "",
    brandName: "Yamaha",
    description:
      "<p>Now in its second version, the Yamaha APX700II features everything that made the APX500 such a hit but also adds a solid Spruce top into the mix to elevate this famous instrument further. This 12 string model is the same size and build as other APX's so it's an easy choice for the stage as well as writing and rehearsing.  </p>\r\n<p>The unplugged sound is bright, percussive with a measured mid range and an extra sweetness provided by the solid timber. This will age and deepen in tone the more you play it, too. This is a great benefit of buying an instrument with a solid top. The beautiful shimmer of a 12 string is present here, nicely balanced by the other frequencies.</p>\r\n<p>This 12 string model retains that easy playability of the six string models despite having twice the number of strings! Holding down barre chords is not a problem and the tension feels about right: not too tight and not too slack.</p>\r\n<p>The System 66 preamp and SRT undersaddle piezo pickup together make a system designed to maximise the sound this body size and shape makes. Onboard controls include a tuner, 3 band EQ, mid Frequency Q control (great for dodging the odd feedback squeal that even the most expensive acoustic guitars are not immune to) and of course a volume control!</p>\r\n<p>Priced within the budget of nearly everyone and with a size and sound that anyone can happily get on with, the APX500III proves to be an enduring classic. This model has the Natural finish.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
