      "Kurt Cobain Jaguar 3 Colour Sunburst NOS Left Handed Rosewood Fingerboard",
    title: "",
    brandName: "Fender",
    description:
      "Grunge's leading light is given his own retrospective tribute with Fender's Kurt Cobain Jaguar. Cobain designed his own custom guitar, the Jagstang, not long before he died and that posthumously became his first signature guitar in the mid 1990s. This Jaguar, however, is famed precisely because it was one of his most visible on stage instruments. \r\n<br/><br/>\r\nThis left-handed, heavily modified Jaguar is based on Cobain's 1965 model. The pickups have been changed to a pair of DiMarzio humbuckers, namely a Super Distortion in the bridge and a PAF in the neck. This of course completely changes the sound: the spiky, nasal twang of the Jag is replaced with thick, powerful humbucker rock sounds; it's a very chunky sound!\r\n<br/><br/>\r\nThe rosewood neck is bound and the headstock is small like a Stratocaster. Even the infamous Jaguar tone controls have been simplified to a three way toggle and a brace of volume and tone knobs.\r\n<br/><br/>\r\nThis fantastic package is completed by a the inclusion of a hard case and a photo book of rare Cobain portraits.",
    productDetail:
      'Fender\'s Kurt Cobain Jaguar® is a new-looking version of the battered and highly unusual 1965 Jaguar that Cobain wielded during the heady early-\'90s era when Nirvana ruled rock and led a musically stunning and culturally subversive movement. Features include an alder body, bound fingerboard with pearloid dot markers, Stratocaster® headstock shape with 1950s-style "spaghetti" logo, DiMarzio® humbucking DP103 PAF 36th Anniversary neck pickup and DP100 Super Distortion bridge pickup, triple knurled "chrome-dome" knob configuration (volume, volume, tone), three-position toggle switch, black chrome Adjusto-Matic™ bridge and Gotoh® sealed tuners. Available in right- and left-handed versions. Accessories include a black textured vinyl hard-shell case and an exclusive Fender Kurt Cobain book with photos and commentary by Charles Peterson and an insightful interview with Nirvana guitar tech Earnie Bailey.',
