    title: "",
    brandName: "Rickenbacker",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Rickenbacker 1993Plus 12-String Jetglo sings with all the chime you'd expect. Based on the 1993 model and updated at the request of Pete Townshend this 12 string model has all the elements of a classic Rickenbacker for the modern player. With its trio \r\nof pickups it certainly has a classic sound and obviously nails that iconic look. As soon as you play it though, you'll realise that it has the quality of a modern instrument that can certainly go the distance.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Vintage Single Coil Toaster Top Pickups</h3>\r\n<p>Fitted with three superb pickups for a huge range of sounds, these Single \r\nCoil pickups can handle a lot. They have that<strong> clarity and chime</strong> \r\nwe've come to expect from Rickenbacker but with an extra special something that has to be heard to \r\nbe believed. </p>\r\n\r\n<h3>24 3/4\" Scale Length</h3>\r\n<p>Familiar and inviting, the scale length used on the 350V63 makes it <strong>\r\neasy to get to grips with </strong>right from the outset. Whether you are doing \r\nsolos or backing rhythms, it all plays smoothly with a good amount of tension.</p>\r\n\r\n<h3>Classic Looks</h3>\r\n<p>There is no mistaking that classic look of a Rickenbacker and the 1993Plus has \r\nmanaged to keep that alive and well. A timeless design with classic looks, yet this guitar still <strong>manages to look right at home on any modern stage</strong>. </p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Not just fans of Rickenbacker but anyone seeking a meeting of vintage and \r\ncontemporary can appreciate what is on offer here.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Classic looks with modern quality</li>\r\n\t<li>Excellent range of vintage style Rickenbacker tones</li>\r\n\t<li>Ready for a life of touring and studio recording</li>\r\n</ul>",
    productDetail:
      "Pete Townshend asked us to reprise and update his beloved Model 1993 guitar and we were only too happy to oblige. The result is the 1993Plus, enhanced with a 1/8 inch (3.1 mm) wider neck, Caribbean rosewood fingerboard and more stable two-piece neck design fitted with a round heel for comfort. This classic 12-string design comes standard with three vintage reissue pickups, stereo output, trapeze tailpiece, vintage knobs and F-hole. Double body binding and pearlescent inlays add a refined touch. X-bracing in the body helps to bring out the full, rich and warm sounds our instruments are known for. The haunting, melodic chorus characteristics of our 12-strings continue to benefit from evolution. The original 1993 design was once exclusive to the British distributor Rose Morris in the sixties.",
