    title: "",
    brandName: "Fender",
    description:
      "It's probably fair to say that there is no guitarist in history who is more iconic, loved and revered than James Marshall Hendrix. Seattle's finest son changed the way every single guitarist approached his instrument: there was simply Before Jimi and After Jimi.\r\n<br/><br/>\r\nSince he was noted for using a Fender Stratocaster far more than any other model, it's only fitting that Fender honour his memory and achievements with this tribute Stratocaster. He famously played left-handed using a right handed Strat restring backwards and played upside down. This is reflected in the 'mirror-image' vibe of this guitar: the headstock is reversed, as is the pickup layout. This isn't just to make a visual reference: things like string tension and harmonic sweet spots were all affected by these changes and many believe they actually contributed to the magic that came from Jimi's soul and fingers.\r\n<br/><br/>\r\nThis model has period-correct 65 era single coil pickups, Jimi's signature on the back of the headstock, 'Woodstock' white finish and a custom 'Experience Hendrix' backplate. Plug one of these in: they are truly electrifying.",
    productDetail:
      'Honoring the electrifying "Voodoo Chile" who popularized the Stratocaster guitar and its tremendous sonic flexibility, the Jimi Hendrix Stratocaster gives you the same fiery tone and playing feel to wield as your own. Full of incendiary vintage tone and classic style, this extraordinary instrument features signature touches and unique appointments based on his distinctive "flipped-over" guitars.',
