    description:
      "<p> Flea, one of modern rock's most celebrated bassists, weighs into the esteemed world of Fender Artist models with this delicious Jazz Bass.\r\n</p>\r\n<p> Having had other previous signature models in the past, Flea became very taken with a particular 70s Jazz bass given to him by a fan. It's now one of his main instruments for recording and touring and it's this bass that's lovingly recreated here for us as a production model.</p>\r\n<p> The Shell Pink finish is a relatively rare example of 70s custom colour, here given the tasteful and charismatic 'Road Worn' light relic'ing which is then coated in a authentic nitrocellulose lacquer. The thick C shape profile neck has a true vintage 7.25\" radius fretboard. The pickups are warm and expressive Pure Vintage models. The is a classy and tasteful bass from a modern master of the instrument. </p>",
    productDetail:
      "Flea’s funk- and jazz-influenced basslines helped propel the Red Hot Chili Peppers to the top of the rock and alternative charts while redefining the role of bass in the modern era. Flea’s unique playing style brought a welcome breath of fresh air to the musical landscape of the past four decades, inspiring countless bassists to add a funky touch to their sound while exploring new techniques and harmonic possibilities. To celebrate his enduring influence, we’ve recreated his prized Shell Pink ’61 Jazz Bass that he received from a fan and used to record the Peppers’ Stadium Arcadium and The Getaway, as well as with the super group, Atoms For Peace. ",
