      "<p>The A series has been designed especially for gigging. Attention has been paid to the SRT2 pickup to make it as effectively plug-and-play as possible; the feel is intended to be comfortably broken-in with it’s rolled fretboard edges; and the construction is typical Yamaha, in other words extremely roadworthy!</p>\r\n<p>This second generation of AC1M uses Yamaha’s Concert sized body with a lower bout cutaway for easy upper fret access. Newly designed bracing gets more volume and projection from the body and the resulting sound is rich and detailed. The body itself is made from solid Sitka Spruce matched with Mahogany for the back and sides. A Vintage Natural finish gives this guitar an air of upmarket quality.</p>\r\n<p>The neck profile has a straight taper for extra comfort: this feels immediately inviting to play on! The SRT piezo pickup system accurately translates your tone to your audience. The side mounted control panel gives you access to volume, a 3 band EQ, the tuner and a Midrange frequency Q selector.</p>\r\n<p>This excellent acoustic is a great choice for the performing musician who wants an very good instrument for touring and performing with.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
    productDetail:
      "Yamaha proudly introduce the new A-Series of acoustic models which are designed for performance. Ideal for travelling and performing musicians, the AC1MII electro acoustic fuses top quality craftsmanship with superior materials and hardware for a versatile playing experience. Including new and innovative onboard electronics and custom design features, the AC1MII is an excellent choice for the keen guitarist.",
