    itemName: "DM12EL Left Handed",
    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Sigma DM12EL is an affordable yet stunning quality, full bodied \r\ndreadnought 12-string guitar that's built for the left handed player. </p>\r\n<p>The solid Spruce top gives this handsome yet understated 12 string plenty of \r\nprojection and resonant tone, while the classic pairing of Mahogany back and \r\nsides ensures a rich, complex tone with plenty of mids and defined bottom end to \r\nbalance the sound out and make this guitar perfect for punching out that lush, \r\nharmonically rich 12 string sound.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Wood Choices</h3>\r\n<p>The DM12EL boasts a classic wood pairing of Spruce and Mahogany. The <strong>\r\nsolid spruce top </strong>ensures plenty of projection and harmonic complexity \r\n(perfect for that big 12 string sound), while the layered mahogany back and \r\nsides give you superb bottom end projection paired with seriously reliable and \r\ndurable construction.</p>\r\n\r\n<h3>12 String</h3>\r\n<p>Nothing fills up the spectrum in your songs like the big, lush resonance of a \r\n12 string, and this guitar brings you that excellent sound at a fantastic price \r\nwithout compromising on quality or tone.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>The DM12EL is perfect for the left handed player looking to really fill out \r\ntheir sound without breaking the bank.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Solid Spruce top</li>\r\n\t<li>Sigma pickup and preamp</li>\r\n\t<li>Crafted to a very high standard</li>\r\n\t<li>Delivers that unmistakable big 12 string sound</li>\r\n</ul>",
    productDetail:
      "<p><span>In the late 1960s the situation for US guitar manufacturers became \r\ndifficult: guitars that were made in Japan, looking very similar to US guitars, \r\nwere flooding the market but at a much lower price. These guitars increasingly \r\nendangered the US manufacturers dominance on the market, and a few American \r\ncompanies reacted to that development in an appropriate manner: They did not \r\ntake any legal steps but instead launched a counter offensive. That’s when \r\n“Sigma Guitars” was born.</span></p>",
