    title: "",
    brandName: "Ibanez",
    description:
      "<p>This handsome open-pore finish 12 string dreadnought forms a part of Ibanez’s Artwood range. Offering up good looking rustic instruments with Solid tops and easy playability, the AW range has taken off in a big way, especially when they are priced so competitively.</p>\r\n<p>This model, the AW5412CE, is a Cutaway Dreadnought 12 string. The dreadnought shape is more than suitable to deliver a sound that has body, context and sparkle. The solid Mahogany top adds mid-range clarity and note separation to deliver a rich and nuanced 12 string sound.</p>\r\n<p>A Fishman Sonicore pickup and Ibanez preamp brings this sound to your audience faithfully and beautifully. This is a 12 string you can rely on.</p>",
    productDetail:
      "<p>The Artwood series was crafted to produce a traditional as well as a modern guitar. Technology moves forward at a frantic pace and the world of guitar craftsmanship is no different. In producing the Artwood series, we've respected the rich tradition of the acoustic guitar while adding modern interpretations in our continuing search for the ultimate in guitar tone.\r\n</p>",
