      "<p><span>The C4-CE's solid African Mahogany top provides a crisp, articulate \r\ntone, combined with African mahogany back and sides for balanced volume and \r\nsustain. The construction is based upon our traditional Spanish classical \r\nguitar, with the inclusion of a soft cutaway and a slightly thinner 50mm-width \r\nneck designed for comfortable playability and easy upper-register reach. Premium \r\ndesign elements such as a Maple binding, Abalone rosette, and a striking \r\nEdgeburst finish will help you stand out from the crowd. The Fishman Sonitone \r\nactive pickup system produces a rich and natural sound when amplified, and puts \r\nthe soundhole mounted controls at your fingertips - perfect for gigging and \r\nrecording.</span></p>\r\n\r\n",
