    category: "GUAG_1",
    online: true,
    itemName: "CPX600RTB Root Beer",
    title: "",
    brandName: "Yamaha",
    description:
      "<p>New from Yamaha for 2018 is the CPX600. The latest model in a long successful line, think of this  as the larger brother of the new APX600 and you will be close to the mark for what we have here. Like the APX, this CPX600I is designed expressly for taking out of the house and onto a stage! With what we’d call a Medium Jumbo body, the CPX gives a larger, more percussive and bass heavy sound. This is ideal for singers who play solo gigs: the extra sonic space filled by the CPX is perfect as an accompaniment for vocals.</p>\r\n<p>The large CPX body has a slightly narrow waist which takes away a little of the mids to give this a great strumming sound: there’s plenty of top and bottom to work in concert to produce that big sound. The bracing inside the body has a new design to create more overall focus. The body also has a Venetian cutaway to provide dextrous players an easier opportunity to scale the dusty end of the fretboard!</p>\r\n<p>Like the new APX600, the CPX600 has a revised 25” scale length to make playing easier and more comfortable than ever: the neck width has also been reduced a touch to make difficult chord shapes easier to stretch to.</p>\r\n<p>A newly re-developed pickup system provides the player with an excellent live sound that’s reliable and very low on feedback.</p>\r\n<p>If you are looking for an instrument that sounds large and confident onstage and off, this Yamaha CPX600 (in Root Beer) is an excellent choice.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
    productDetail:
      "<p>Combining the performance of the APX 600 with a bigger body for traditional looks and a more powerful, louder acoustic sound, the CPX 600 offers all of the advantages of the APX models with all of the style of the Yamaha's jumbo body style</p>",
