    itemName: "California Series Redondo Player Belmont Blue",
    title: "",
    brandName: "Fender",
    description:
      "<p>Fender, that most Californian of guitar brands, brings us a fresh new series of acoustic guitars that celebrates the Sunshine State. This boldly beautiful range takes inspiration from the surf, mountains and blue skies of California to offer a great looking, easy to play range of Fenders that bask in the sun-drenched beaches and palm trees of Fender’s home state.</p>\r\n<p>Continuing the theme of using Los Angeles area beaches for their model names, the Redondo Player sparkles and shines with a larger, vaguely dreadnought-styled body with a venetian cutaway on one shoulder for upper fret access.</p>\r\n<p>This guitar has a Solid Spruce top for high quality tone that has plenty of liveliness and dynamics. The quality increases further with cream-coloured binding on the body and a cool stylised pickguard.<p>\r\n<p>The neck is a kind of hybrid, electric guitar-influenced design that’s slim and comfortable with Fender’s world famous Stratocaster headstock, not only for style but also for greatly increased strength in this vulnerable area. The headstock is painted Belmont Blue to match the body.</p>\r\n<p>Gigging is a breeze with specially designed and voiced pickup system, made in collaboration with Fishman.<p>\r\n<p>The beautiful acoustic has its own style, sound and feel.</p>\r\n",
    productDetail:
      "<p>Bold and brash, the chest-thumping sound of this big-bodied acoustic was designed to inspire from the moment you pick it up. The exclusive slope-shouldered Redondo body shape has a rich, commanding voice that fills any room. The gloss metallic top, back and sides, as well as a matching painted 6-in-line headstock and crème binding, give it a shot of electrifying attitude. Dynamic, unique and unconventional—like today’s guitarists—the Redondo Player refuses to be bound by the past.</p>",
