    itemName: "Neptune Blood Moon",
    title: "",
    brandName: "Faith",
    description:
      "<p>For over 15 years now, Faith guitars have been delivering top class acoustic guitars designed by noted UK luthier Patrick James Eggle. With a good mixture of traditional and original designs, Faith guitars offer, in Eggle’s own words: “an instrument that is both highly desirable and highly functional. A piece that would be as visually effective when silent as it would be sonically when in the hands of a skilled musician.\" There are a number of ranges, each with their own features and finishing techniques, that will appeal to a wide range of players looking for a quality instrument from a contemporary maker.<p>\r\n<p>The Blood Moon series is made entirely of an unusual and striking Javanese tonewood called Trembesi. This timber has a similar tone to Mahogany (warm and clear) but has a little extra top end detail too which sweetens the sound. Visually, Trembesi (AAA Grade quality here) looks not unlike Koa with it’s wide and dramatic grain making for a beautiful looking guitar-making wood.</p>\r\n<p>The Blood Moon range are all bound with flamed Maple and finished in a lovely orange/deep red transparent Blood Moon burst.</p>\r\n<p>This Blood Moon model is a Neptune shape, basically a Baby Jumbo that's based on Patrick Eggle’s Saluda shape. It’s a great balance of size, projection and balanced tone that has a good deal of presence but no too much low end. This guitar sits great in a mix and is good for both strumming and fingerpicking. A Fishman Sonicore pickup system lets you get gigging straight away.</p>\r\n<p>Visually exciting, tonally delicious and with an added bonus of uniqueness, the Faith Blood Moon Neptune comes highly recommended.</p>",
    productDetail:
      "<p>Faith Neptune Acoustic Guitars are based upon Patrick James Eggle's highly \r\nacclaimed 'Saluda' shape. In its basic form, the Neptune is 16\" across the lower \r\nbout, which qualifies it as a baby-jumbo. In practise, this makes the Neptune a \r\nJumbo bodied guitar for every occasion. Whereas the full jumbo sized Jupiter is \r\nall-out big, the Neptune balances size, sonic projection and comfort perfectly. </p>\r\n<p>Acoustically, the Neptune will deliver rich and deep bass notes with ease, \r\nyet never become 'boom-ey' or over-powering. Plus when it's strapped around your \r\nneck for hours at a rehearsal or gig, it sits comfortably without weighing you \r\ndown too much. </p>\r\n\r\n",
