    itemName: "TSBT-e Taylor Swift Baby Taylor ",
    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Taylor Swift Baby Taylor TSBT-e is a small body acoustic designed to give anyone a big voice. Unless you've been living under a rock, chances are that you are aware of the impact Taylor Swift has made with her unique style of music. She continues to inspire musicians across a number of styles and this beautiful guitar from Taylor is another aspect of that influence. Back in her youth before she was the household name she is now, Swift was writing songs on her own Baby Taylor guitar. This model, which is based on the 3/4 scale Dreadnought, captures the essence of that magical time in her life. A layered sapele body and a solid \r\nsitka spruce top provide a solid construction and allow this guitar to sing beautifully. A pickup and preamp make this perfect for those who perform live. As you would expect from Taylor Guitars, this is a well made instrument and \r\nwould be ideal for players at any level. </p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Screen Printed Design</h3>\r\n<p>This design is <strong>filled with Swift's unique charm and style</strong>. The intricate \r\ndetail around the soundhole features a rosette design with the word 'Love' \r\nweaved into the vine pattern. Her signature takes centre place above the bridge \r\nand adds an extra touch of Tay Tay influence to this beautiful guitar.</p>\r\n\r\n<h3>Expression System Baby Pickup</h3>\r\n<p>Featuring Taylor's impressive Expression System Baby pickup, it is perfect \r\nfor those who are looking to perform live or record. Being able to plug in and \r\nplay is a great feature and is also <strong>very practical with the onboard preamp and \r\ntuner</strong>.</p>\r\n<h3>Compact Size Body</h3>\r\n<p>The smaller body size is perfect for those who prefer a more compact size. \r\nWhether you want a guitar that is easier to carry to practice and gigs or \r\nsomething that comfortably fits under your arm, this is <strong>a great size for both \r\nbeginners and pros alike</strong>.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Of course this guitar is perfect for any Taylor Swift fan. Additionally it's a great choice for any new or young player thanks to it's comfortable size and easy playability. </p>\r\n\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Perfect for those who prefer a more compact acoustic</li>\r\n\t<li>An ideal guitar for any fan of Taylor Swift</li>\r\n\t<li>Versatile due to the pickup and preamp</li>\r\n</ul>\r\n\r\n\r\n",
    productDetail:
      "<p>Inspired by memories of writing songs on her own Baby Taylor, Taylor Swift collaborated with Taylor Guitars to design the Taylor Swift Baby Taylor (TSBT). Based on our compact ¾-scale Dreadnought, the TSBT is crafted from a resilient layered sapele body with a solid Sitka spruce top. Swift’s screen-printed rosette design features the word “Love” three times among a delicate vine motif. The personalized design also features her stylized signature above the bridge. With a slim 1 11/16-inch neck and a compact shape, the guitar is perfect for a young, aspiring tunesmith. This edition also features the Expression System Baby™ (ES-B) pickup for a smooth plug-and-play experience. Adding to the utility is a built-in digital chromatic tuner on the preamp. The preamp/tuner unit features an LED display for tuning and low battery indication, along with Tone and Volume controls.\r\n\r\n</p>",
