    productDetail:
      "<p>The Alvarez Artist Blues Series delivers genre-specific instruments to \r\ncapture the very essence of American music history. Body shapes, bracings and \r\nconstructions were carefully considered before opening molds for our body shapes \r\nand finalizing specifications.</p>\r\n<p>Alvarez Blues guitars have a vintage vibe all the way, with a small rectangle \r\nbridge, V profile neck, 2 ¼” string spacing and back shifted bracing to make \r\nthese smaller bodied guitars feel and sound just right.</p>\r\n<p>Tonally they deliver the compressed bluesy bark expected from such a design, \r\nbut the refined back-shifted, scalloped bracing adds more openness for a \r\nslightly more modern style projection.</p>\r\n<p>The Delta 00 has a 14th fret neck join to the body, grained ivoroid binding \r\nand a perfect vintage burst. It’s a responsive guitar and although suited more \r\ntowards fingerstyle it takes open chord strumming in its stride. This \r\nacoustic-electric model features the fantastic LR Baggs Element pickup, VTC \r\nsystem to optimize live performance.</p>\r\n\r\n",
