    brandName: "Yamaha",
    description: "",
    productDetail:
      "<p>Derived from Yamaha's FS820, which has the solid spruce top and mahogany \r\nback/sides, the FSX820C comes with a cutaway body and adds System 66 electronics \r\nplus an SRT Pickup. Yamaha's proprietary under-saddle piezo pickup and System 66 \r\nanalog preamp ensure you'll always have a solid plugged-in performance. The \r\nsmall and thin body is perfect not only for female/young players, but for \r\nintermediate-to-upper level finger-picking style players as well.</p>\r\n\r\n<p><strong>Special \r\nBracing</strong><br>Yamaha's FS guitars have a louder and stronger sound in the \r\nlow-to-mid ranges, thanks to cutting-edge acoustic analysis technology developed \r\nby the Yamaha R&D Division. Yamaha’s engineers have achieved this sound by \r\nutilizing analysis and simulation to arrive at the best bracing design without \r\ndepending on tradition or guesswork. This analysis led to the development of the \r\nnew scalloped bracing pattern, a new and ideal acoustic structure that maintains \r\nthe durability of the top board while bringing out the most sound the Yamaha FS \r\nhas to offer.</p>\r\n<p><strong>Thinner body</strong><br>The FS model body is 10mm slimmer than that \r\nof the FG body, offering increased comfort and playability with no loss of \r\nvolume or bass. Having a body that is easier to hold makes the FS more appealing \r\nto beginners and smaller guitarists, including female players. In addition, the \r\nsmaller dimensions and lower propensity to feedback make FS guitars ideal for \r\nstage use.</p>\r\n<p><strong>System 66 Electronics</strong><br>System 66 feature an under-saddle \r\npiezo pickup developed by Yamaha. Controls include a 3-band EQ, an adjustable \r\nmid-range frequency control, and a precision chromatic tuner for optimum sound \r\ntailoring. The system is powered by easy to obtain AA-size batteries that \r\nprovide a stable power supply for improved sound quality.</p>\r\n\r\n<p>*<strong>9 Volt battery not included.</strong></p>\r\n",
