    productDetail:
      "<p>Made the way Jumbo guitars should be, the AJ80CE is big, blonde and powerful, \r\nwith a broad, articulate projection, lots of low end and shimmering trebles.</p>\r\n<p>Like all Artist Series guitars, our jumbos are designed to offer a rewarding \r\nplaying experience. In this model we use our FST2 bracing system which works so \r\nwell with the amount of air volume a large guitar body produces. The forward \r\nshifted pattern with asymmetric scalloped tone bars allows the venation to \r\nescape while adding enough stiffness to achieve great clarity, separation and \r\neven volume across all six strings.</p>\r\n<p>This CE model is fitted with the wonderful LR Baggs StagePro EQ and Element \r\npick up for a great live experience.</p>\r\n\r\n",
