    itemName: "50 Series F-50MCE",
    title: "",
    brandName: "Finlayson",
    description:
      "<p>Finlayson guitars is a new and exciting range of superb acoustic guitars, designed in collaboration with esteemed luthier Billy Finlayson and industry titan Robert Godin of Godin guitars.</p>\r\n<p>This range of guitars, designed in Scotland and handcrafted in La Patrie, Canada, is a WORLD EXCLUSIVE: Godin do not make guitars for anybody else so this unique collaboration is unprecedented and extremely special.</p>\r\n<p>Part of the reason that Finlayson guitars sound so good is the use of Adirondack Spruce for the inner bracing. Bracing forms and shapes much of the guitar’s voice & projection so using Adirondack Spruce, which is the strongest and lightest species of Spruce, is a massively important part of the process. </p>\r\n<p>The Finlayson guitars range has been a long time in the making: exhaustive efforts have been made to ensure that playability, sound quality, beauty and value have all been met to a stringently high standard. Every guitarist looking for a quality electro acoustic needs to try out this incredible new range: Finlayson guitars set the standard.</p>\r\n<p>The F50MCE is a lovely Folk-style guitar. This type of body design is exceptional for fingerpicked styles: volume and projection meet with a mix of warmth and sweetness lent by the solid tonewoods. This guitar has a body made from solid Mahogany and a top from solid Spruce. This combination mixes strong fundamentals with warmth. </p>\r\n<p>The meticulously dressed frets sit in a thick Rosewood fingerboard, itself topping a Mahogany neck. The F50MCE is an easy joy to play and really promotes sustained playing sessions.</p>\r\n<p>Alongside the aforementioned herringbone purling, this Finlayson has natural binding and a Rosewood soundhole rosette. It is a guitar of understated beauty and class.</p>\r\n<p>Fingerstyle guitarists who also enjoy a strum will adore the sound and playability on display here with the FInlayson F50MCE.</p>",
