    brandName: "Ibanez",
    description:
      "<h2>At A Glance</h2>\r\n<p>With its eye catching body shape, the Ibanez Talman is one for the guitarist \r\nwho is looking for something a little different! Talmans are great for those in \r\nneed of a compact, portable acoustic that plays as easily as an electric guitar. \r\nThese small and shapely instruments are fun to make music on since they are so \r\neasy to play. With fine woods, a good build quality plus a pickup and \r\nelectronics, it is your best friend for playing live or recording. </p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Figured Ash Top</h3>\r\n<p>While this looks incredible and gives the guitar a look all of its own, it \r\nplays a more important part in the overall sound of the guitar. With its clear \r\nand bright tone, it is certainly a great way to showcase your playing in any \r\nscenario.</p>\r\n\r\n<h3>Plug And Play Versatility</h3>\r\n<p>With a great sounding Ibanez AP2 Magnetic pickup and onboard AEQ preamp you are all set for any \r\nsituation where you need to be amplified. Just plug in to an amp and you are \r\nready to perform!</p>\r\n<h3>Double Cutaway</h3>\r\n<p>The double cutaway body design is a real player friendly feature. It makes \r\nreaching those higher notes easy; ideal for more intricate playing when accuracy \r\nis everything. It also looks pretty cool and gives the Talman a style of its \r\nown.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Great as a portable guitar</li>\r\n\t<li>Unique looks</li>\r\n\t<li>Ideal for the performing musician</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Ibanez TCM50 Galaxy Black Open Pore</li> \r\n</ul>\r\n",
    productDetail:
      "The TCM50 features Ibanez’s iconic Talman body design with Figured Ash top, Sapele back and sides. The double-cutaway and shallower body construction allows electric guitar players to switch to acoustic easily. Electronics include AP2 magnetic pickup for warmer sound, along with AEQ200M preamp w/2-band EQ. The TCM50 also features a Treated New Zealand Pine fretboard and bridge, with Ibanez Advantage Bridge Pins for improved tuning stability.",
