      "<p>The AG75WCE was the first Grand Auditorium model we introduced in 2010 and \r\nhas remained one of our best-selling models ever since. The high-quality cedar \r\ntop helps to bring an immediate openness to its voice and paired with Walnut, \r\nthis solid top guitar has great warmth and fantastic response. This models also \r\nsuits all styles of playing, no matter if you need a bigger voice for open chord \r\nstrums or the finesse of gentle fingerstyle, the AG75WCE’s versatility will \r\nhandle it perfectly –</p>\r\n<p>It has an understated but classy aesthetic, castaway for higher fret access \r\nand is fitted with the brilliant LR Baggs StagePro EQ and Element pick up for \r\noptimal live performance.</p>\r\n\r\n",
