    title: "",
    brandName: "Martin",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Martin Dreadnought Junior Spruce is a great choice for anyone looking for \r\na guitar with a more manageable size. This smaller dreadnought shape is capable \r\nof a brilliant sound with great projection and a balanced tone.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Junior Dreadnought Body Shape</h3>\r\n<p>This smaller version of a dreadnought body shape is perfect for those who are \r\nlooking for a big dreadnought sound in a smaller body.</p>\r\n<h3>Martin X-Brace</h3>\r\n<p>Martin's X-Brace system dates back almost 200 years, designed to present the \r\nperfect balance between reliability and optimised tonal quality, in a guitar \r\nthat will last a lifetime. The X-Brace design supports the guitar's soundboard \r\nwithout negatively impacting the guitars natural resonance and character.</p>\r\n<h3>Tonewoods</h3>\r\n<p>Fitted with sapele back and sides and a sitka spruce top, this model projects \r\nwonderful warm tones with a strong midrange response. The combination of \r\ntonewoods and this body shape give great projection despite the smaller body \r\nsize</p>\r\n<h3>Fishman Sonitone Pickup</h3>\r\n<p>Fishman have a reputation as one of the best pickup manufacturers in the \r\nworld and their acoustic guitar pickups are especially loved. The Sonitone \r\nseries pickup offers exceptional transparency to present the true sound of your \r\nguitar to a speaker system. The pickup system also features a volume and tone \r\ncontrol neatly tucked into the soundhole, making the guitar look more \r\ntraditional, whilst still giving you full control of your sound.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Smaller dreadnought shape gives all of the benefits of a dreadnought but in \r\na smaller package</li>\r\n\t<li>Martin's X-Brace system is tried and tested to bring the best sound</li>\r\n\t<li>Spruce and sapele construction provides great tone</li>\r\n\t<li>Plug in and play with the onboard pickup system</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Why not have a look at all of our <a href=\"https://www.guitarguitar.co.uk/martin/guitars/acoustic/6-string/\">6 \r\nstring Martin acoustic range?</a></p>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>MMartin Dreadnought Junior Spruce E</li>\r\n\t<li>Gig bag/li>\r\n</ul>",
    productDetail:
      "<p><span>The Dreadnought Junior Series is designed for players looking for big \r\nDreadnought sound in a slightly smaller body.</span></p>\r\n<p><span>The updated Junior models sport a thinner, 000 body depth with softer \r\nback edges to provide maximum comfort while playing.</span></p>\r\n<p><span>Every Junior model includes a form-fitted nylon gig bag for easy \r\ntransport.</span></p>\r\n",
