    title: "",
    brandName: "Yamaha",
    description: "",
    productDetail:
      "<p>Yamaha® CG-TA classical nylon-\r\nstring guitars transport you to\r\nnew creative spaces with immersive\r\nreverb and lush chorus effects – all\r\nwithout an amp or other external\r\ngear. Wherever you’re playing, the\r\nwarm tone and inspiring effects will\r\ncaptivate any audience.</p>\r\n\r\n<h3>Actuator</h3>\r\n<p>An actuator installed on the inner surface of the guitar back vibrates in response to the vibrations of the strings. The vibrations of the actuator are then conveyed to the body of the guitar, and to the air in and around the guitar body, generating authentic reverb and chorus sounds from inside the body.</p>\r\n\r\n<h3>Simple Controls</h3>\r\n<p>Three simple knobs let you adjust the degree of effect applied and the lineout volume level. Additionally, keeping the controls small minimizes the area of the holes in the body material, reducing acoustic sound loss.</p>\r\n\r\n<h3>Newly Designed Battery Box</h3>\r\n<p>Battery box integrated into the end-pin jack. This requires fewer holes in the body, thus reducing acoustic sound loss. Connect the cable from the jack to a PA or amp to use as an acoustic electric guitar.\r\n\r\n</p>\r\n",
