    title: "",
    brandName: "Alvarez",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The handsome ADM66CEAR dreadnought from Alvarez is built to be the perfect gigging companion. \r\n\r\nThe all Mahogany construction delivers a fantastic tone that's enhanced by the LR Baggs electronics, which will carry that great tone on into your PA or amp. \r\n\r\nFinally the beveled armrest gives an added level of comfort to the iconic dreadnought shape. </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Mahogany Construction</h3>\r\n<p>The ADM66CEAR features an all Mahogany construction. Mahogany emits a warm and focused tone. Giving your notes plenty of definition with a distinctive character. </p>\r\n<h3>FS6 Bracing</h3>\r\n<p>Alvarez FS6 bracing system uses an X-brace design that's closer to the soundhole. Featuring tapered scalloping to the X and asymmetrical scalloping to the tone bars.  FS6 offers an enhanced bass presence, clear mids and a rounded off high end to achieve a warm and rich tone. </p>\r\n<h3>Electronics</h3>\r\n<p>LR Baggs' powerful tone shaping Stage Pro EQ system is coupled with their innovative Element pickups. Which reproduces the vibration of your guitars top to pick up its most subtle nuances. This pairing gives you a guitar that sounds amazing plugged in, straight out the box!\r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>All Mahogany construction delivers warmth, clarity and definition of tone.</li>\r\n<li>Powerful tone shaping capability in the LR Baggs EQ and pickup so you sound great plugged in.</li>\r\n</ul>\r\n\r\n",
