    title: "",
    brandName: "Alvarez",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The handsome ADWS77CESHB dreadnought from Alvarez is built to be the \r\nperfect gigging companion, with its all walnut construction delivering fantastic \r\ntone, electronics that will carry that great tone on into your PA or amp, and a \r\nslimmer-than-average body shape that'll feel comfortable for a long night's \r\nmusic, sitting down or standing up.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Walnut Construction</h3>\r\n<p>The ADWS77CESHB features an all Walnut construction. Walnut in a guitar emits \r\na tone with a bright top end and a very present and pleasing midrange, giving \r\nyour notes plenty of dynamic response and definition. The tone of Walnut also \r\ntends to deepen nicely as it ages too.</p>\r\n<h3>Body Shape</h3>\r\n<p>The ADWS77CESHB features Alvarez' Slim Dreadnought body shape. Being a little \r\nnarrower front to back than an average dreadnought, it sits comfortably in the \r\nlap for playing while retaining the Dreadnought's great projection and quick \r\nresponse.</p>\r\n<h3>Electronics</h3>\r\n<p>LR Baggs' powerful tone shaping Stage Pro EQ system is coupled with their innovative Element pickup system that reproduces the vibration of the top of your guitar, picking up your guitar's most subtle nuances. This pairing gives you a guitar that sounds amazing plugged in, straight out the box!</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>All Walnut construction delivers warmth, clarity, and definition of tone.</li>\r\n\t<li>Powerful tone shaping capability in the LR Baggs EQ and pickup so you \r\n\tsound great plugged in.</li>\r\n</ul>\r\n",
    productDetail:
      "<p>The ADWS77CESHB is a lively dreadnought and delivers a warm, focused tone from its all Walnut construction. Its body is slimmer than our standard dreadnought shape making it a very comfortable instrument while retaining great projection and quick response. The gloss Shadowburst finish on the Walnut creates a rich aesthetic which is perfectly framed by the Flame Maple binding. This is a beautiful guitar and would be a great choice for gigging with its slimmer depth and LR Baggs electronics.</p>",
