    description:
      "<h2>At A Glance: </h2>\r\n<p>The stunning AGE95CESHB  Grand Auditorium from Alvarez is built to be the perfect gigging companion. The Western Red Cedar top with Macassar Ebony body is a rare and inspired pairing of woods. Giving this guitar a warm and open tone with darker trebles and a pronounced low end. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Grand Auditorium Shape</h3>\r\n<p>The Grand Auditorium sits between the larger Dreadnought and petite Orchestra models. Making the Grand Auditorium a resonant and characterful guitar that comfortably fits to your body.\r\n</p>\r\n<h3>FS6 Bracing System</h3>\r\n<p>Alvarez's FS6 bracing system uses an X-brace design that's closer to the soundhole. Featuring tapered scalloping to the X and asymmetrical scalloping to the tone bars.  FS6 offers an enhanced bass presence, clear mids and a rounded off high end to achieve a warm and rich tone. </p>\r\n<h3>Electronics</h3>\r\n<p>LR Baggs' powerful tone shaping Stage Pro EQ system is coupled with their innovative Element pickups. Which reproduces the vibration of your guitar's top to pick up its most subtle nuances. This pairing gives you a guitar that sounds amazing plugged in, straight out the box!\r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Comfortable body shape</li>\r\n<li>Powerful tone shaping capability in the LR Baggs EQ and pickup so you sound great plugged in.</li>\r\n</ul>\r\n",
