      "<h2>At A Glance: </h2>\r\n<p>The Gibson Les Paul Standard '60s model is <strong>yet another fantastic \r\nguitar from Gibson's Original Collection</strong>. Bringing to the table an \r\nalternative to the '50s Les Paul Standard, this '60s version comes with a \r\nslimmer neck profile and swaps the pickups for a sound subtly different to that \r\nof the '50s Standard.</p>\r\n<p>The body of this model has zero weight relief, a bonus for Les Paul \r\naficionados, some who believe the drill holes used by Gibson to remove the heft \r\nof a solid mahogany body, take with them some of the tone.  Gibson have \r\nlistened to those who are after a 'full fat' Les Paul, and have delivered \r\nexactly that.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Full Fat Les Paul</h3>\r\n<p>A point of contention, some believe that the chambered body of newer Les \r\nPauls can have a thinner tone than what you would expect to get from a Les Paul. \r\nThis model has none of that! This mahogany body has zero weight relief giving \r\nyou the <strong>'full fat' Les Paul tone </strong>so many desire. But make sure \r\nyour shoulder is ready for the heft!</p>\r\n<h3>Slim Taper Neck Profile</h3>\r\n<p>The neck profile of a guitar is greatly important to how it feels when \r\nplaying. The Slim Taper shape on this model offers comfort for the player and \r\ngives access to the higher frets allowing you to reach all the way to the top of \r\nthe fretboard when you're rocking out! However, this is a Gibson after all, \r\nalthough named 'Slim Taper' there is still plenty to grab on to.</p>\r\n<h3>61R/T Burstbucker Pickups</h3>\r\n<p>Differing from the '50s Standard Les Paul, the burstbucker 61R and 61T \r\npickups selected for this model offer a little more heat and sizzle. With this \r\nguitar you'll be suited to playing Blues, Crunchy Rock, and great sustained \r\nleads. <strong>It sounds wonderful!</strong></p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Zero weight relief, giving the 'full fat' Les Paul tone</li>\r\n\t<li>The Slim Taper neck feels great and will have you playing all \r\n\tnight long!</li>\r\n\t<li>61R/T Burstbucker pickups offer blazing tones and sustain for days!</li>\r\n</ul>",
    productDetail:
      "The new Les Paul Standard returns to the classic design that made it relevant, played\r\nand loved -- shaping sound across generations and genres of music. It pays tribute to\r\nGibson's Golden Era of innovation and brings authenticity back to life. The Les Paul\r\nStandard 60's has a solid mahogany body with an AA &#1048737;gured maple top, and a slim\r\ntaper 60's-style mahogany neck with a rosewood &#1048737;ngerboard and trapezoid inlays.\r\nIt's equipped with a classic-style Tune-O-Matic bridge, aluminum stop bar tailpiece,\r\nGrover Rotomatic \"Kidney\" tuners, and gold top hat knobs with silver re&#1048738;ectors. The\r\nBurstbucker 61R (neck) Burstbucker 61T (bridge) pickups are loaded with AlNiCo V\r\nmagnets, audio taper potentiometers and orange drop capacitors.",
