    itemName: "SG Standard Heritage Cherry",
    title: "",
    brandName: "Gibson",
    description:
      "<h2>At A Glance: </h2>\r\n<p>Since day one, the SG has earned its place as <strong>a Rock classic.</strong></p>\r\n<p>The SG is generally sought out by players who enjoy the thick signature \r\nGibson sound but find the likes of a Les Paul too heavy or lacking upper fret access. The thinner mahogany body and double cutaway design of this model \r\nencourages long, creative sessions of playing.</p>\r\n<p>As with the rest of this range, Gibson have gone for a more traditional look, \r\nsound, and spec for the SG. <strong>The SG's famous tone is all here</strong>; \r\nless overtly thick than a Les Paul, grouped with plenty of sustain. The perfect \r\ninstrument for Classic Rock crunch, Heavy Metal riffs, and ripping solos, the SG \r\ncan also deliver in Indie, Funk, Blues, and Pop.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>490R/T Pickups</h3>\r\n<p>Sounding pretty hot, the 490R and 490T pickups are often found on Les Paul \r\nCustoms. <strong>They sound large, powerful and full of energy!</strong></p>\r\n<h3>Rounded Neck Profile</h3>\r\n<p>The 'Rounded' neck profile from Gibson is somewhat larger than their others, \r\nsuch as the 'Slim Taper'. This means that <strong>this neck will feel great in your hands while playing</strong>, especially over extended periods of rocking! \r\nOffering great access all across the fretboard, if you prefer a good chunk of \r\ntimber to hold on to, this could be the one for you!</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>490R/T pickups offer hot, powerful tones</li>\r\n\t<li>Rounded neck profile feels great!</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Why not have a look at the rest of our\r\n<a href=\"https://www.guitarguitar.co.uk/gibson/sg/\">Gibson SG range?</a></p>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Gibson SG Standard Heritage Cherry</li>\r\n\t<li>Gig Bag</li>\r\n</ul>",
    productDetail:
      "The Gibson SG Standard rocks the classic looks and features associated with the\r\nlate 60's style SG models sought after by many. A rounded pro&#1048737;le mahogany neck,\r\nbound rosewood &#1048737;ngerboard, long tenon 19th fret neck joint, and a solid mahogany\r\nbody provide the backbone for singing sustain. The 490R and 490T Alnico II pickups\r\nprovide the power to drive. A black, 5-ply, full-face pickguard set this SG Standard\r\napart from others... a truly versatile classic.",
