    description: "",
    productDetail:
      "<p>For players who appreciate the mojo of the past matched to contemporary \r\nfeatures, Fender created the Vintera ‘60s Jazzmaster Modified. Blending classic \r\nlooks with a modern neck profile and fingerboard radius, hotter pickups and \r\nupdated electronics—this guitar packs a surprising amount of power under the \r\nhood.</p>\r\n<p>For modern Fender tone they re-voiced the pair of single-coil Jazzmaster \r\npickups, kicking things up a bit by increasing the output. The warm, \r\nsmooth-sounding neck pickup is balanced by the bright, cutting bridge pickup. \r\nThe “Modern C”-shaped neck has a 9.5”-radius maple fingerboard with 21 \r\nmedium-jumbo frets for modern playing feel. An Adjusto-matic™ bridge is paired \r\nto Jazzmaster floating tremolo and vintage-style tuning machines provide \r\noriginal-era aesthetics, rock-solid performance and tuning stability. Other \r\nfeatures include the classic lead/rhythm circuit, chrome hardware and 4-bolt \r\nneck plate. Includes a deluxe gig bag.</p>\r\n\r\n",
