    title: "",
    brandName: "Martin",
    description:
      "<h2>At A Glance: </h2>\r\n<p>Designed for players looking for a big sound from a smaller body, the \r\n000CJr-10E is now available for the first time with a cutaway.</p>\r\n<p>Offering warm tones, comfort and portability with the onboard electrics, the \r\n000CJr-10E is the perfect guitar for any situation!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>000 Body Size</h3>\r\n<p>The 000 body size lies comfortably between a parlour and a dreadnought. This \r\nmakes it comfortable in your lap, but still boasts plenty of volume and \r\nprojection.</p>\r\n<h3>Cutaway</h3>\r\n<p>Offering greater access to the upper frets, this is the first time a cutaway \r\nhas been available on this model. If you're proned to less open chords and more \r\nintricate melodies, then this could be the model for you.</p>\r\n<h3>Fishman Sonitone</h3>\r\n<p>The built in pickup in this model is a great addition. Giving you the ability \r\nto plug in and amplify your sound whenever you may need, the Fishman Sonitone \r\npickup projects a natural and responsive sound from your guitar to your amp. \r\nIt's never been easier to take your music to the stage!</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>000 body size sits comfortably and gives great projection</li>\r\n\t<li>Cutaway allows upper fret access</li>\r\n\t<li>Fishman Sonitone pickup sounds great and allows you to amplify anytime</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Why not have a look at our whole <a href=\"https://www.guitarguitar.co.uk/martin/000/\">Martin 000 range?</a></p>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Martin 000CJr-10E</li>\r\n\t<li>Gig Bag</li>\r\n</ul>",
    productDetail:
      "<p>The Junior Series is designed for players looking for big sound in a slightly smaller body. Now available for the first time with a cutaway, the Auditorium style 000CJr-10E features sapele back and sides, which offer warm tones with a strong midrange response. </p>\r\n<p>It includes a Sitka spruce top for added warmth and projection and a hand-rubbed neck with a high-performance taper for ease of playability. This model also sports a soft back edge to provide maximum comfort while playing. </p>\r\n<p>The 000CJr-10E is equipped with Fishman Sonitone electronics and includes a soft gig bag for easy transport so you can take your music anywhere. Strung with Retro light gauge strings.</p>\r\n",
    salesPrice: 695.0,
    pictureMain:
      "https://images.guitarguitar.co.uk/cdn/large/150/190711346006008f.jpg",
