    itemName: "BT2-e Baby",
    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance:</h2>\r\n<p>The Baby Taylor BT2-e is a loud and tough little acoustic! It sports high quality yet affordable materials and a sturdy build. It is a 3/4 sized dreadnought, making it perfect for use as a travel guitar. It is also a great choice for children. \r\nThe ES-B pickup also opens up a whole other world of uses, making it perfect for \r\nperforming, recording or anywhere you want to plug in.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Solid, Quality Materials</h3>\r\n<p>As well as a gorgeous tropical mahogany top, the guitar sports an ebony fretboard. Layered sapele is used for the back and sides to reduce costs and provide climate-resistant construction.</p>\r\n<h3>Shorter Neck and Scale Length</h3>\r\n<p>  The Baby Talor BT2 has a scale length of  22 3/4” and 19 frets. It also has a shorter than average neck which makes playing fast and fun.</p>\r\n<h3>  Expression System Baby Pickup</h3>\r\n<p>  This incorporates elements of the the Taylor ES2 pickup system in order to \r\naccurately capture the tones of the guitar. It ensures that you sound at your \r\nbest while performing or recording. A great option to have, especially at this \r\nprice point.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Sturdy, reliable build</li>\r\n<li>Versatile due to the pickup</li>\r\n<li>Makes a great travel guitar</li>\r\n<li>Perfect for kids and smaller players</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Taylor BT2-e</li>\r\n<li>Taylor Gig Bag</li>\r\n</ul>\r\n\r\n\r\n\r\n",
    productDetail:
      "The mahogany-top version of the Baby Taylor will yield a slightly darker, earthier tone than its spruce top sibling. The pint-size Dreadnought was originally inspired by a desire to provide a smaller, starter-size guitar for kids and a legitimate musical companion for travelers, but players have since adapted it for their needs in all sorts of creative ways, from high-stringing it to setting it up to play lap slide, to embracing alternate tunings that add unique acoustic flavors to recordings. This model also comes equipped with the Expression System Baby™ (ES-B) pickup, which incorporates piezo design elements from the Taylor ES2. The pickup is powered by an onboard preamp with a built-in digital chromatic tuner. The preamp/tuner unit features an LED display for tuning and low battery indication, along with Tone and Volume controls.",
    salesPrice: 439.0,
