    brandName: "Taylor",
    description:
      "<h2>At A Glance:</h2>\r\n<p>The Taylor 114e is a versatile, and large sounding guitar. It features \r\nquality materials and is a perfect option if you want great value for money. The \r\nslightly narrower nut width makes it easy to navigate around the fretboard which \r\nis ideal for those with smaller hands or beginners. A pickup adds the option to \r\nplug in and play which is ideal for performing musicians or anyone who needs an \r\nextra bit of volume. It has a full sound due to the size but is also still easy \r\nto play and transport giving you the best of both worlds. </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality, Affordable Materials</h3>\r\n<p>The 114e features a solid sitka spruce top and a layered walnut back and sides. This is perfect for players who are unable to stretch to the cost of an all-solid guitar but don't want to lose out on that fantastic tone.</p>\r\n<h3>Grand Auditorium Body Shape</h3>\r\n<p>Introduced back in 1994, this original design by Bob Taylor sounds big and is \r\nmore than capable of filling a room. It is a mid sized body that is somewhere \r\nbetween a Dreadnought and a Grand Concert.</p>\r\n<h3>Expression 2 System</h3>\r\n<p>This is widely recognised as one of the greatest acoustic pickup systems available. It translates every ounce of tone, detail and dynamic from your fingertips, strings and guitar wood. This gives the audience an accurate and fully realistic translation of your performance.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>A full sounding guitar that is easy to play</li>\r\n<li>Excellent value for money</li>\r\n<li>Features one of the best pickup systems</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Taylor 114e</li>\r\n<li>Taylor Gig Bag</li>\r\n</ul>",
    productDetail:
      "<p>The 114e features our popular Grand Auditorium body style, whose physical dimensions have made it a popular choice for its appealing performance versatility. Layered walnut back and sides are topped with a solid Sitka spruce soundboard, which together produce signature clear and balanced tone with a pleasing projection and midrange focus. The 1-11/16-inch nut width is slightly narrower than the standard 1-3/4-inch width of other steel-strings in the 300 Series and up, making it easier for developing players to navigate the fretboard. And with Taylor’s onboard Expression System 2 pickup, the guitar is ready to plug in whenever you are. The guitar ships in a durable lightweight gig bag.</p>",
