    title: "",
    brandName: "Martin",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Road Series from Martin is perfect for the value-conscious player \r\nsearching for a full sized, solid wood acoustic with the known and trusted \r\nMartin tone that has shaped multiple generations of music!</p>\r\n<p>All models in this series include a High-Performance neck taper for increased \r\ncomfort as well as satin and gloss finish options and a variety of tonewood \r\ncombinations. </p>\r\n<p>One of the most notable features of this series is the onboard Fishman MX-T \r\npickup system with built in soundhole tuner allowing you to amplify and tune \r\nwhenever you need.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Dreadnought Body Shape</h3>\r\n<p>Martin's Dreadnought body creates a rich tone with plenty of depth, clarity \r\nand character. The larger body also makes it great for strumming, giving a \r\nconsistent volume and even tone without impacting your dynamic range.</p>\r\n<h3>X-Brace</h3>\r\n<p>Martin's X-Brace system dates back almost 200 years, designed to present the \r\nperfect balance between reliability and optimised tonal quality, in a guitar \r\nthat will last a lifetime. The X-Brace design supports the guitar's soundboard \r\nwithout negatively impacting the guitars natural resonance and character.</p>\r\n<h3>Eco-Conscious Materials</h3>\r\n<p>The use of FSC certified woods for the construction of this guitar is a great \r\ndetail to see coming from Martin. Using certified woods ensures that the \r\nmaterials are coming from reliable sources and causing as little harm to the \r\nenvironment as possible. </p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Dreadnought body shape is great for projection and volume</li>\r\n\t<li>Martin's X-Brace gives balance between reliability and tonal quality</li>\r\n\t<li>Eco-Conscious construction is a great development to see from Martin</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Martin D10E-01</li>\r\n\t<li>Gig Bag</li>\r\n</ul>",
    productDetail:
      "<p>With a sapele top, back and sides, this solid wood Dreadnought model is a great sounding guitar at an affordable price. New to this model are stunning mother-of-pearl pattern fingerboard and rosette inlays with a multi-stripe rosette border. It has an FSC® Certified Richlite® fingerboard and bridge, satin finish body, and a hand-rubbed neck finish. Also new to this model is the Fishman® MX-T electronics package with a built-in soundhole tuner that auto mutes the audio output so you can tune up any time without using a pedal. This guitar comes with a Premium Soft Shell Case so it is Road-ready to join you on all of your adventures!",
