    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance:</h2>\r\n<p>The Taylor 114ce Grand Auditorium is a versatile, and large sounding guitar. It features \r\nquality materials and is a perfect option if you want great value for money. The \r\ncutaway gives the player an easy time reaching the higher frets so it is great \r\nfor anyone who wants to do some lead work. The Taylor pickup system adds extra flexibility to amplify this acoustic all while sounding incredibly detailed. It has a full sound due to the size but is also still easy to play \r\nand transport giving you the best of both worlds. </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality, Affordable Materials</h3>\r\n<p>The 114ce features a solid Sitka spruce top and a layered walnut back and sides. Providing a solid resonant top with a layered back and sides keeps this guitar affordable while <strong>still singing with that great Taylor tone we love</strong>. </p>\r\n<h3>Grand Auditorium Body Shape</h3>\r\n<p>Introduced back in 1994, this original design by Bob Taylor sounds big and is \r\nmore than <strong>capable of filling a room while not feeling too bulky</strong>. It is a mid-sized body that is somewhere \r\nbetween a Dreadnought and a Grand Concert.</p>\r\n<h3>Expression System 2</h3>\r\n<p>This is widely recognised as one of the greatest acoustic pickup systems available. It <strong>translates every ounce of tone, detail and dynamic</strong> from your fingertips, strings and guitar wood. This gives the audience an accurate and fully realistic translation of your performance.</p>\r\n<h2>Who Is It For?</h2>\r\n<p>Anyone looking for a professional level acoustic without breaking the bank. A great choice for gigging musicians or a player looking to take a step up from more affordable acoustics. </p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>A full sounding guitar that is easy to play</li>\r\n<li>Excellent value for money</li>\r\n<li>Features one of the best pickup systems</li>\r\n</ul>\r\n",
    productDetail:
      "<p>This cutaway acoustic/electric Grand Auditorium blends layered walnut back and sides with a solid Sitka spruce top, making it a great all-around acoustic that responds well to strumming, flatpicking and fingerpicking. With our patented Taylor neck, you’ll enjoy easy playability and accurate intonation as long as you own the guitar, and the slightly narrower 1-11/16-inch nut width makes forming barre chords easier on the hands.  The Venetian cutaway gives you access to more upper-end fretboard real estate, while our dynamic Expression System 2 pickup produces a natural amplified acoustic voice that will help you sound your best whenever you plug in. The clean appointment scheme includes Italian acrylic dot fretboard inlays, a 3-ring rosette, plus black binding and a black pickguard that complement the look of the genuine ebony fretboard and bridge. The guitar includes a lightweight protective gig bag for easy portability.</p>",
