    title: "",
    brandName: "Ibanez",
    description:
      "<h2>At A Glance: </h2>\r\n<p>Ibanez are proud to announce their renewed and updated AEG series models, \r\nheld in high regard for decades for their easy playability, compact bodies and \r\nslim necks. This model, the AEG50, starts with the new Ibanez AEQ-TTS preamp, \r\nboasting simple but effective Volume and Shape controls, as well as well as an \r\neasy-to-read onboard tuner to keep you in tune at a glance. With its clean and \r\nelegant looks, quality construction and all new electronics, the AEG50 looks and \r\nsounds outstanding.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Easy Playability</h3>\r\n<p>The AEG50 boasts the easy playability the AEG series is known for, and \r\nfeatures a slim, compact body that's comfortable to play in any position, seated \r\nor standing, while the slim neck feels great in the hand, lending itself to any \r\nplaying style from simple chording to more adventurous lead work.</p>\r\n<h3>Electronics</h3>\r\n<p>The AEG50 features the Ibanez T-bar II Undersaddle pickup, designed to \r\nequalise the volume from each individual string to deliver a well-balanced \r\nsignal to the preamp. The preamp here is Ibanez's new AEQ-TTS, a small and \r\nsimple preamp boasting a Volume and a powerful Shape control which lets you take \r\nyour tone from low, fat and powerful, to a very natural and clear acoustic \r\ntone in the centre position, right up to a super bright and crispy tone - all by \r\nturning just one knob. The AEQ-TTS is rounded out with a reliable on-board tuner \r\nwith easy to read LCD display.</p>\r\n<h3>Simple, Elegant Looks</h3>\r\n<p>The AEG50 boasts an understated yet elegant look thanks to its black \r\nfretboard binding, simple rosette and handsome multi-stripe body binding. It \r\nlooks every bit as good as it sounds.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Easy playability thanks to its slim neck and compact body.</li>\r\n\t<li>Simple yet powerful tone shaping electronics</li>\r\n\t<li>Clean, elegant looks to match its quality tone</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Ibanez AEG50 Black High Gloss</li>\r\n</ul>",
    productDetail:
      "<p>The AEG, a compact body electric acoustic guitar with a slim neck has been \r\nwell-accepted for its easy playability for more than two decades. Ibanez is \r\nproud to announce that the AEG series has been renewed with updated electronics \r\nand looks. The changes were based on the concept, “simple and easy control.”</p>\r\n<p>The AEG50 starts with a new preamp, an Ibanez AEQ-TTS. The small and simple \r\npreamp has only two control knobs, volume and shape. This at-a-glance tone \r\ncontrol offers natural acoustic sound in the center position. It allows players \r\nto adjust the tone easily and enables them to go from low, fat and powerful \r\ntones to a bright and crispy sound while adjusting only one knob. A new \r\neasy-to-read onboard tuner with LCD(liquid crystal display) is located on the \r\npreamp.</p>\r\n<p>The AEG50 comes with a simplified rosette, a binding and ornamentation on the \r\nheadstock. These finer details add a sharp and stylish atomosphere to the \r\nguitar.</p>\r\n<p>Other features include a Spruce top and a Sapele back & sides body, an Ibanez \r\nT-bar II Undersaddle pickup which equalizes the volume from each string and \r\ndelivers a well-balanced signal, and special bulb-shaped Ibanez Advantage Bridge \r\npins for easy string installation.</p>\r\n\r\n",
