    itemName: "114e Grand Auditorium Left Handed",
    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Taylor 114e features the popular Grand Auditorium body style, one of \r\nTaylor's most versatile shapes. First introduced in 1994, with refined \r\ndimensions suited to both flat and finger picking styles, the Grand Auditorium \r\nbody shape is one for any style. </p>\r\n<p>The top of the body is made from solid sitka spruce, a particular favourite \r\ntonewood of Taylor due to it's high resonance level, making it the perfect \r\nsoundboard.</p>\r\n<p>In addition to the natural sound projection, the 114e is fitted with Taylor's \r\nExpression System 2, neatly tucked away, allowing you to plug into an amplifier.</p>\r\n<p>Taylor guitars have a fantastic reputation when it comes to premium guitar \r\nproduction, the Taylor 114e is testimony to this</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Grad Auditorium Body</h3>\r\n<p>The Grand Auditorium body shape produces a natural acoustic voicing, loud \r\nenough to handle mid level strumming and picking while holding balance across \r\nthe tonal spectrum. Many singer-songwriters have adopted the Grand Auditorium \r\nshape due to it's <strong>ability to cover a wide range of sounds</strong> which \r\nallows musicians to travel with just one guitar when performing and writing \r\nwhich is why the Grand Auditorium body shape continues to be one of Taylor's \r\nmost popular</p>\r\n<h3>Expression System 2</h3>\r\n<p>The Taylor Expression System 2 provides the latest in Taylor's <strong>\r\ncontinual innovation</strong> of acoustic guitar amplification. the heart and \r\nsoul of the ES2 is Taylor's patented behind-the-saddle pickup. Featuring three \r\nindividually calibrated and uniquely positioned pickup sensors, this \r\nenables a more dynamic range of acoustic sounds to be captured than was possible \r\nbefore. </p>\r\n<h3>Quality Tonewoods</h3>\r\n<p>As a guitar soundboard (top), Sitka Spruce is the most popular of the modern \r\nera. Found on 85 - 90% of the guitars that Taylor make, the combination of \r\nstrength and elasticity produces a versatile dynamic range allowing for \r\neverything from aggressive strumming to delicate fingerpicking. Sitka spruce is\r\n<strong>Bob Taylor's personal favourite</strong> tonewood for an all round great \r\nguitar. </p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Materials and construction allow for a broad range of styles.</li>\r\n\t<li>Expression System 2 allows you to plug in and play whenever you need, at \r\n\tany time.</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Love Taylor guitars? Have a look at our whole\r\n<a href=\"https://www.guitarguitar.co.uk/taylor/guitars/acoustic/lh/\">left handed \r\nTaylor range</a></p>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Taylor 114e LH</li>\r\n\t<li>Gig bag</li>\r\n</ul>",
    productDetail:
      "<p>The 114e features Taylor's popular Grand Auditorium body style, whose \r\nphysical dimensions have made it a popular choice for its appealing performance \r\nversatility. Layered walnut back and sides are topped with a solid Sitka spruce \r\nsoundboard, which together produce signature clear and balanced tone with a \r\npleasing projection and midrange focus. The 1-11/16-inch nut width is slightly \r\nnarrower than the standard 1-3/4-inch width of other steel-strings in the 300 \r\nSeries and up, making it easier for developing players to navigate the \r\nfretboard. And with Taylor’s onboard Expression System 2 pickup, the guitar is \r\nready to plug in whenever you are.</p>\r\n",
