      "<h2>At A Glance:</h2>\r\n<p>The Taylor Academy 10e is a fantastic dreadnought acoustic, designed to be comfortable and very easy to play. It features high quality yet affordable materials, making it great value for money.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Comfortable, Beveled Armrest</h3>\r\n<p>The guitar has a beveled armrest for added comfort. This feature is usually reserved for the absolute top-end Taylor guitars. It’s a refreshing and bold move to include it on such an affordable model!</p>\r\n<h3>Quality, Affordable Materials</h3>\r\n<p>The 10e is made with a solid Sitka Spruce soundboard and an Ebony fingerboard. Taylor have ensured that the most important elements to playing - sound, feel and comfort - are the number one priority. Costs are kept down by using layered Sapele for the back and sides, and by keeping the finish Matte. Instead of extra decorative elements, a simple sound hole rosette and dot inlays are used.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Comfortable to play thanks to beveled armrest</li>\r\n<li>Great value for money</li>\r\n<li>Very easy to play, with a slightly shorter than average scale length</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Taylor Academy 10e</li>\r\n<li>Taylor gig bag</li>\r\n</ul>",
