    description:
      "<h2>At A Glance: </h2>\r\n<p>The DSME is a beautiful short scale guitar from Sigma. This is a large-bodied guitar with a rich booming tone and features a sitka spruce top, mahogany back and sides, a low profile neck and a natural-sounding pickup system.</p>\r\n\r\n<p>This grand example of Sigma craftsmanship would make an excellent guitar for learners or an affordable and reliable gigging guitar for experienced players. </p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>D Shortscale Guitar</h3>\r\n<p>The DSME is a unique take on the Dreadnought guitar, featuring the classic large body with a slightly more slender depth and a shorter scale. It's an excellent option for smaller players or beginners looking for a loud guitar, without compromising on comfort. \r\n</p>\r\n\r\n<h3>Sitka Spruce Top</h3>\r\n<p>Sitka spruce is one of the most popular tonewoods used on modern acoustic guitars. It's loved for its bright character which brings clarity and detail to your playing. \r\n</p>\r\n\r\n<h3>Sigma Acoustic Pickup</h3>\r\n<p>The guitar features a great sounding pickup system that captures the natural chime of the guitar and features three tone controls which allow you to quickly refine the sound of the guitar to suit different venues. The system also features a built-in tuner so you can quickly maintain the guitar's tuning between songs. \r\n</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Shorter scale is comfortable for beginners</li>\r\n<li>Great sounding and reliable guitar</li>\r\n<li>Sigma pickup system makes gigging easy</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Love this, why not take a look at our full range of \r\n<a href=\"https://www.guitarguitar.co.uk/sigma/guitars/acoustic/\">Sigma</a> guitars?</p>\r\n\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Sigma DSME</li>\r\n</ul>\r\n",
