    description:
      "<h2>At A Glance: </h2>\r\n<p>The DM7E by Sigma is one of the most unique acoustic guitars we've seen in a long time. At its heart, it's a standard D-14 acoustic, but the addition of a second G string brings it into a whole new territory. An acoustic guitar with 7 strings may seem like an unusual choice, but its 12 string like chime gives it a beautiful sound that's been combined with a mahogany body and a Sitka spruce top to create something we feel is a bit special. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>7 Strings?</h3>\r\n<p>The additional string accompanies the G string, only an octave higher like on a 12 string guitar. The result is a tone that is a nod towards the classic tone of a 12 string guitar, without sounding like a cliché. It's definitely just as comfortable to play as a 6 string guitar, but has a signature confidence to its sound, with chords and melodies boldly announcing themselves from the guitar. \r\n</p>\r\n\r\n<h3>Sigma Preamp</h3>\r\n<p>While the guitar sounds absolutely stunning when played acoustically, the addition of a pickup system makes the DM7E the ideal gigging companion. With a transparent sounding pickup, plus a built in EQ and tuner, getting your guitar sounding great in the live setting is easy!\r\n</p>\r\n\r\n<h3>D-14 Body</h3>\r\n<p>Sigma's D-14 body is based one of the most famous acoustic guitar body shapes, the Dreadnought dates back over 100 years and is loved for its bold and rich tone, large size and its loud volume. It's also highly regarded for its versatility...fingerpicking, heavy strumming, rock music, folk, prog...the list of the Dreadnoughts uses are boundless.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Unique 7 string design with beautiful chiming tones</li>\r\n<li>Built in pickup system makes this the ideal gigging guitar</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Love this? Why not browse through our full range of<a href=\"https://www.guitarguitar.co.uk/sigma/guitars/acoustic/\"> Sigma guitars</a>?</p>\r\n\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Sigma DM7E 7 String</li>\r\n</ul>\r\n",
