    description:
      "<h2>At A Glance:</h2>\r\n<p>The BT1-e from Taylor is a loud and tough little acoustic! It sports high \r\nquality yet affordable materials and an impressive build. It is a 3/4 sized dreadnought, making it perfect for use as a travel guitar. It is also a great choice for children. \r\nThe ES-B pickup opens up a whole other world of uses, making it perfect for performing, recording or anywhere you want to plug in.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Solid, Quality Materials</h3>\r\n<p>As well as a gorgeous Sitka spruce top, the guitar sports an ebony fretboard, these same materials are used across the Taylor line up all the way to the top! It's great to see Taylor build affordable instruments with this same <strong>commitment to quality</strong>. </p>\r\n<h3>Shorter Neck and Scale Length</h3>\r\n<p>  It has a scale length of  22 3/4” and 19 frets which reduces the overall size of the guitar making it much easier to handle. This is perfect for travelling when you're just looking for an easy to play instrument but is also great for newer or smaller players.  </p>\r\n<h3>Taylor Electronics</h3>\r\n<p>Designed after Taylor's renowned \"Expression System 2\" pickup the ES-B also features <strong>an on-board digital tuner and LED display</strong> for maximum ease of use. With Taylor's reputation of great-sounding pickups you can feel comfortable in its tone and reliability.  </p>\r\n<h2>Who Is It For?</h2>\r\n<p>If you're travelling but want to bring a reliable quality guitar this is the one for you! Due to its smaller size and easy playability it's also great for newer players, smaller players, or younger players. </p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Sturdy, reliable build</li>\r\n<li>Versatile due to the pickup</li>\r\n<li>Makes a great travel guitar</li>\r\n<li>Perfect for kids and smaller players</li>\r\n</ul>\r\n\r\n\r\n",
