      "<h2>At a Glance:</h2>\r\n<p>The Taylor 110e Left Handed is a versatile, easy-to-play acoustic guitar. It features quality materials and is a great option if you want great value for money!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality, Affordable Materials</h3>\r\n<p>The 110e features a solid Sitka Spruce top and a layered Walnut back and sides. This is perfect for players who are unable to stretch to the cost of an all-solid guitar but don't want to lose out on that fantastic tone.</p>\r\n<h3>Dreadnought Body Shape</h3>\r\n<p>This comfortable shape provides a loud and focused sound.</p>\r\n<h3>Expression System 2</h3>\r\n<p>This is widely recognised as one of the greatest acoustic pickup systems available. It translates every ounce of tone, detail and dynamic from your fingertips, strings and guitar wood. This gives the audience an accurate and fully realistic translation of your performance.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Very easy to play, with a patented Taylor neck and a slightly narrower 1-11/16-inch nut width</li>\r\n<li>Excellent value for money</li>\r\n<li>Features one of the best pickup systems</li>\r\n</ul>\r\n<h2>What's Included?</h2>\r\n<ul>\r\n<li>Taylor 110e Left Handed</li>\r\n<li>Taylor gig bag</li>\r\n</ul>\r\n",
