    title: "",
    brandName: "PRS",
    description:
      "<h2>At A Glance: </h2>\r\n<p> The PRS SE Limited Edition AE50E Angelus is an acoustic with all the \r\ntrimmings! </p>\r\n<p>Equipped with a solid top, gorgeous colour finished flame maple back and \r\nsides, and some Private Stock appointments, this acoustic is not only stunning, \r\nbut a real player's piece. </p>\r\n<p>As with all PRS SE acoustics you can also take this on the road or to the \r\nstudio thanks to the Fishman GT1 pickup system and included hard-case.</p>\r\n<p>At only 100 pieces this is one high spec, limited model that's certain not to \r\nstick around!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Gorgeous Looks</h3>\r\n<p>The <strong>limited edition finish</strong> on this acoustic is breathtaking. The Abalone \r\nappointments on the rosette and the inlays enhance the ebony fingerboard and \r\nsolid Sitka spruce top. Not to mention the stunning burst finish on figured \r\nmaple back and sides.</p>\r\n<p>Stylish, and certainly one to stand out.</p>\r\n<h3>Private Stock Bracing</h3>\r\n<p>The AE50E comes equipped with PRS X/Classical Hybrid Bracing. This is \r\ndesigned to offer the best of traditional X-bracing and classical ladder bracing \r\nto create a <strong>resonant, powerful voice.</strong></p>\r\n<h3>Ready To Tour</h3>\r\n<h3>Fishman GT1</h3>\r\n<p>Fishman have a reputation as one of the best pickup manufacturers in the world and their acoustic guitar pickups are especially loved. The Fishman GT1 series pickup offers <strong>exceptional transparency to present the true sound of your guitar</strong> to a speaker system. The system also features a volume and tone control discreetly tucked into the soundhole, so there are no ugly control panels screwed onto the body. It looks like a traditional acoustic with the control and convenience of an electro-acoustic, truly the best of both worlds.\r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Limited edition with only 100 pieces made!</li>\r\n\t<li>Discreet electronics allow for maximum functionality while staying \r\n\thidden and unobtrusive</li>\r\n\t<li>Private Stock techniques for unmatched tone</li>\r\n</ul>\r\n",
    productDetail:
      "<p>The PRS SE A50E pairs maple back and sides with a solid spruce top for \r\nstunning warmth and depth. When matched with PRS hybrid“X”/Classical bracing, \r\nwhich allows the top to freely vibrate and project, the SE A50E has an uncommon \r\n3-dimensional character for a maple back and side guitar. The Angelus Cutaway \r\nbody shape delivers comfort and playability, well suited for picking and \r\nfingerstyle playing.</p>\r\n<p>Plugged in, the Fishman GT1 pick up system delivers dynamic, organic tone and \r\nallows players to easily take this guitar from rehearsal to the stage. This \r\nelectronics system features an undersaddle pickup and soundhole mounted preamp \r\nwith easy-to-access volume and tone controls.</p>\r\n<p>Additional high-quality features include a solid spruce top, ebony fretboard \r\nand bridge, bone nut and saddle, as well as PRS trademark bird inlays and \r\nheadstock design. All PRS SE acoustics ship with a high-quality hardshell case. </p>\r\n\r\n",
