    title: "",
    brandName: "PRS",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The PRS SE T40E Tobacco Sunburst combines decades worth of experience and craftsmanship to create a modern style acoustic guitar that's inviting to play and sounds amazing.  Whether you're playing acoustically or plugged in, the T40E always sounds great, thanks to the solid Sitka Spruce top,\r\nOvangkol back & sides, PRS Hybrid “X” bracing, and a Fishman GT1 pickup. </p>\r\n\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Toneare Grand Shape</h3>\r\n<p>A wonderful shape that feels comfortable for many and provides the delicate tone needed for finger picking styles but still offers the volume and power of a larger acoustic. The Tonare Grand shape <strong>packs volume and dynamics in to a compact and comfortable package.</strong></p>\r\n\r\n<h3>PRS Hybrid “X” Bracing</h3>\r\n<p>PRS have evolved the traditional \"X\" design and incorporated a fan style bracing behind the bridge, this creates a <strong>round sweet tone</strong> that projects beautifully from the guitar. \r\n</p>\r\n\r\n<h3>Fishman GT1</h3>\r\n<p>Fishman have a reputation as one of the best pickup manufacturers in the world and their acoustic guitar pickups are especially loved. The Fishman GT1 series pickup offers <strong>exceptional transparency to present the true sound of your guitar</strong> to a speaker system. The system also features a volume and tone control discreetly tucked into the soundhole, so there are no ugly control panels screwed onto the body. It looks like a traditional acoustic with the control and convenience of an electro-acoustic, truly the best of both worlds.\r\n</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Comfortable guitar for most players</li>\r\n<li>Fishman pickup makes gigging easy</li>\r\n</ul>\r\n\r\n",
    productDetail:
      "<p>The <strong>PRS SE T40E</strong> pairs ovangkol back and sides with a solid \r\nspruce top for full, lush tone. When matched with PRS hybrid“X”/Classical \r\nbracing, which allows the top to freely vibrate, the SE T40E’s voice projects \r\nwith breathtaking volume and delicate nuance. The Tonare Grand body shape \r\ndelivers a familiar feel and a thunderous tone, well suited for picking and \r\nfingerstyle playing.</p>\r\n<p>Plugged in, the Fishman GT1 pick up system delivers dynamic, organic tone and \r\nallows players to easily take this guitar from rehearsal to the stage. This \r\nelectronics system features an undersaddle pickup and soundhole mounted preamp \r\nwith easy- to-access volume and tone controls.</p>\r\n<p>Additional high-quality features include a solid spruce top, ebony fretboard \r\nand bridge, bone nut and saddle, as well as PRS trademark bird inlays and \r\nheadstock design. All PRS SE acoustics ship with a high-quality hardshell case.</p>\r\n",
