    title: "",
    brandName: "Martin",
    description:
      "<h2>At A Glance:</h2>\r\n<p>In the early '70s, Martin were asked to design an all-black D-35 for Country \r\nlegend, Johnny Cash. the \"Man in Black\" then went on to play his custom D-35 on \r\nstage for the next 20 years.</p>\r\n<p>It wasn't until 2006 that Martin released a commemorative D-35 Johnny Cash \r\nedition of the model. This guitar is a nod to the lengthy history between Cash \r\nand Martin Guitar.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Fishman MX Pickup</h3>\r\n<p>Fishman have a reputation as one of the best pickup manufacturers in the \r\nworld and their acoustic guitar pickups are especially loved. The MX series \r\npickup offers exceptional transparency to present the true sound of your guitar \r\nto a speaker system. The pickup system also features a volume and tone control \r\nneatly tucked into the sound hole, so there are no ugly control panels screwed \r\nonto the body. It looks like a traditional acoustic but with the control and \r\nconvenience of an electro-acoustic, truly the best of both worlds.</p>\r\n<h3>Dreadnought Body</h3>\r\n<p>This Dreadnought body creates a rich tone with plenty of depth, clarity and \r\ncharacter. The larger body also makes it great for strumming, giving a \r\nconsistent volume and even tone without impacting your dynamic range.</p>\r\n<h3>Martin X-Brace</h3>\r\n<p>Martin's X-Brace system dates back almost 200 years, designed to present the \r\nperfect balance between reliability and optimised tonal quality, in a guitar \r\nthat will last a lifetime. The X-Brace design supports the guitar's soundboard \r\nwithout negatively impacting the guitars natural resonance and character.</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n\t<li>Plug in and play with the built in pickup system</li>\r\n\t<li>Dreadnought body shape great for projection</li>\r\n\t<li>Martin X-Brace</li>\r\n</ul>\r\n<h2>Other Things To Consider:</h2>\r\n<p>Have a look at our whole <a href=\"https://www.guitarguitar.co.uk/martin/guitars/acoustic/6-string/\">Martin \r\n6 string range</a></p>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n\t<li>Martin DX Johnny Cash Left Handed</li>\r\n\t<li>Gig bag</li>\r\n</ul>\r\n",
    productDetail:
      '<p>In the early 1970s, Martin Guitar was commissioned to design an all-black \r\nlacquered D-35 for country star Johnny Cash. Though Martin had never considered \r\nsuch a request before, an all-black D-35 for the "Man in Black" was custom-made. \r\nCash went on to play his custom D-35 on stage for the next 20 years. In 2006, \r\nMartin released a commemorative D-35 Johnny Cash edition. New for 2019, the DX \r\nJohnny Cash is a nod to the history between Cash and Martin Guitar. </p>\r\n',
