    description:
      "<h2>At A Glance: </h2>\r\n<p>The Taylor BBTe is a versatile guitar featuring quality tonewoods, Taylor's X Bracing system and their Expression System 2 pickup. The Big Baby Taylor is a 15/16-size Dreadnought body guitar, providing that big tone in a portable instrument. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality Woods</h3>\r\n<p>The BBTe has Layered Walnut back and sides, this wood boasts rich brown hues that look great as well as adding general warmth to the guitar's tone. The Sitka Spruce top brings produces a broad dynamic range that's accommodating to a wide range of playing styles. </p>\r\n<h3>X-Bracing</h3>\r\n<p>Taylor's X-Bracing system provides a continuous flow of strength throughout the body of the guitar and provides top wood rigidity in spite of the soundhole's location in the middle of the soundboard. \r\n</p>\r\n<h3>Expression System 2</h3>\r\n<p>This is widely recognised as one of the greatest acoustic pickup systems available. It translates every ounce of tone, detail and dynamic from your fingertips, strings and guitar wood. This gives the audience an accurate and fully realistic translation of your performance. This version also features a built-in digital tuner that's useful in any situation. \r\n</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Great sound produced by quality woods</li>\r\n<li>Taylor Big Baby body shape</li>\r\n<li>Suited to a wide variety of playing styles and musical genres</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Taylor BBTe Walnut LH</li>\r\n<li>Gig Bag</li>\r\n</ul>\r\n",
