    description: "",
    productDetail:
      "<p>The guitar that set the standard for the travel guitar market, the enduringly \r\npopular Baby Taylor makes a great musical companion. Portable, playable and \r\naffordable, the Baby features a solid spruce top and yields impressive volume \r\nand tone for its compact, three-quarter-size scale. It’s the perfect travel \r\nmate, it’s a great choice for kids taking lessons, and artists from Lindsey \r\nBuckingham to Bono to Taylor Swift have used one for songwriting, recording and \r\nperforming. With its unique dimensions and tonal personality, players have used \r\nit in other creative ways, from high-stringing it to setting it up to play lap \r\nslide to adding a capo to evoke mandolin-like sounds.</p>\r\n",
