    itemName: "Venus Blue Moon",
    title: "",
    brandName: "Faith",
    description: "",
    productDetail:
      "<p>The Venus Blue Moon is a truly individual instrument. One of the beauties of \r\ngenuinely solid, natural tonewoods is that each piece of solid timber used will \r\nvary in its natural colouration and its particular grain patterns. So your Blue \r\nMoon will be as unique as you and your music.</p>\r\n<p>Tonally, Mango has an interesting character. It is not as loud and punchy as \r\nrosewood nor as straightforwardly mellow as mahogany, yet it bears its own \r\ndistinctive warmth. With frequency prominence starting a little below that of \r\nmahogany and dropping off a little earlier in the mid-range, the overall tone \r\ncould be described as dark and moody. Much like maple guitars, the reduced level \r\nof resonant overtones makes the Mango-bodied Blue Moon a perfect stage guitar: \r\nEminently controllable, balanced and resistant to feedback.</p>\r\n<p>Mango trees grow freely right across the Indonesian archipelago, so the \r\ntimbers used on Blue Moon guitars are sourced close to our workshops in Java, \r\nIndonesia, and as always, from certified timber merchants.</p>\r\n<p>Finished with flamed Maple binding, Macassan Ebony fittings, Fishman \r\nElectronics and complete in a hard case, your Faith Venus Blue Moon is sure to \r\nintrigue and delight you at every turn.</p>\r\n<p>The Venus is the now iconic shape that brought Faith Guitars to the \r\nconsciousness of so many players over the years. The combination of a 15\" lower \r\nbout and a slimmer depth of body looks to classic OM or Auditorium body-shapes \r\nfor inspiration, and makes the Venus the perfect compromise. In fact, the Naked \r\nVenus was voted 'The UK's Best Acoustic Guitar' at the MIA Music Awards in \r\n2013. </p>\r\n<p>It is still big enough to deliver a big acoustic performance, yet remains \r\nsmall enough for the player to jump around on stage with no problem. </p>\r\n",
