    itemName: "SE A50E Blue Matteo",
    title: "",
    brandName: "PRS",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The PRS SE A50E Blue Matteo combines decades worth of experience and craftsmanship to create a modern style acoustic guitar that's inviting to play and sounds amazing.  Whether you're playing acoustically or plugged in, the A50E always sounds great, thanks to the solid sitka spruce and \r\nfigured maple construction, PRS Hybrid “X” bracing and a Fishman GT1 pickup. </p>\r\n\r\n<p>We love PRS' interpretation of the classic acoustic guitar and think this would make an excellent investment for a student guitarist or a reliable gigging guitar for a professional musician. </p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Angelus Cutaway Body</h3>\r\n<p>The guitar is similar in size to a Grand Concert guitar, making it comfortable for most players and the Angelus cutaway allows for easy access to the higher frets. The medium-sized body brings a slight compression to the tone, making it ideal for both picking and fingerstyle playing. \r\n</p>\r\n\r\n<h3>PRS Hybrid “X” Bracing</h3>\r\n<p>PRS have evolved the traditional \"X\" design and incorporated a fan style bracing behind the bridge, this creates a round sweet tone that projects beautifully from the guitar. \r\n</p>\r\n\r\n<h3>Fishman GT1</h3>\r\n<p>Fishman have a reputation as one of the best pickup manufacturers in the world and their acoustic guitar pickups are especially loved. The Fishman GT1 series pickup offers exceptional transparency to present the true sound of your guitar to a speaker system. The system also features a volume and tone control discreetly tucked into the soundhole, so there are no ugly control panels screwed onto the body. It looks like a traditional acoustic with the control and convenience of an electro-acoustic, truly the best of both worlds.\r\n</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Comfortable guitar for most players</li>\r\n<li>Fishman pickup makes gigging easy</li>\r\n<li>Blue Matteo finish on the back and sides is stunning!</li>\r\n</ul>\r\n\r\n\r\n",
    productDetail:
      "<p>The PRS SE A50E combines decades worth of experience and craftsmanship to create a modern style acoustic guitar that's inviting to play and sounds amazing.  Whether you're playing acoustically or plugged in, the A50E always sounds great, thanks to the solid sitka spruce and \r\nfigured maple construction, PRS Hybrid “X” bracing and a Fishman GT1 pickup. </p>\r\n\r\n<p>We love PRS' interpretation of the classic acoustic guitar and think this would make an excellent investment for a student guitarist or a reliable gigging guitar for a professional musician. </p>\r\n",
