    itemName: "GJA12-SG200 Jumbo 12 String Vintage Sunburst",
    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sigma GJA12-SG200 is a fantastic 12-string guitar, offering a big sound and gorgeous looks. Its 12 strings offer players beautifully rich, bold and shimmering tones. The large jumbo sized body packs a punch, giving this guitar a naturally loud volume, as well as adding depth and bass. It also features a built-in Fishman pickup, making it ready for the stage. This is a great choice for anyone looking for that iconic 12 string sound.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>12 Strings</h3>\r\n<p>Giving a shimmering and chorus-like effect, and popularised by artists such \r\nas The Beatles, The Eagles and Led Zeppelin, 12 String guitars have been a \r\nmainstay of popular, rock and folk music for decades. </p>\r\n<h3>Gorgeous Looks</h3>\r\n<p>Taking inspiration from the iconic pre-war American made flat tops, this \r\nSigma looks truly fantastic! We love all its elegant features, including an \r\nengraved pickguard, gold hardware, moustache bridge and crown inlays. But that’s \r\nnot all… turn the guitar around and you’ll see the stunning flamed maple back \r\nand sides. </p>\r\n<h3>Big Sound</h3>\r\n<p>The Sigma GJA12-SG200 features a jumbo sized body, giving this guitar a huge, \r\nrich and deep sound! A, discretely placed, Fishman Sonitone pickup is also \r\nincluded, making this guitar stage-ready. Fishman make some of the best quality \r\nand natural sounding pickups in the world, so you can be sure you’ll sound just \r\nas great plugged in as you do acoustically. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Iconic looks and sound at an affordable price</li>\r\n\t<li>Large body giving a loud and clear sound</li>\r\n\t<li>On board Fishman pickup ready to go</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Sigma GJA12-SG200 12 String Guitar</li>\r\n\t<li>Sigma SSC-GJ soft case</li>\r\n</ul>\r\n\r\n\r\n",
    productDetail:
      "<p>In the late 1960s the situation for US guitar manufacturers became difficult: \r\nguitars that were made in Japan, looking very similar to US guitars, were \r\nflooding the market but at a much lower price. These guitars increasingly \r\nendangered the US manufacturers dominance on the market, and a few American \r\ncompanies reacted to that development in an appropriate manner: They did not \r\ntake any legal steps but instead launched a counter offensive. That’s when \r\n“Sigma Guitars” was born.</p>\r\n",
