    description: "",
    productDetail:
      "<p>Recording King has been a well regarded secret among professional resonator \r\nplayers for the last decade. Now anyone can get a professional quality resonator \r\nat a great price in the Recording King Rattlesnake. The hand-spun European \r\nRecording King cone is a world-class tone engine for classic reso tone and \r\nvolume, and the open pedestal-style soundwell creates a uniquely loud and broad \r\nsonic palette. A removable handrest for quick adjustment, bone nut, and high \r\nquality tuning machines round out this instrument. All that's left to add is the \r\nactual snake rattle for true vintage mojo. </p>\r\n<p>Soundposts support the circle of the soundwell so the cone vibrations are \r\nfree to bounce within the full cavity of the body. The Pedestal soundwell is \r\ndesigned to give the Rattlesnake an open, thick mid-range sound. </p>\r\n<p>The best-selling Recording King Rattlesnake Resonator comes with a \r\nfactory-installed Fishman Nashville pickup for electric blues players. The \r\npassive Fishman Nashville pickup can deliver clear, musical tone or slide over \r\ninto dirty and gritty territory as you dig into the strings and roll up your amp \r\nvolume.</p>",
