    itemName: "Emily Wolfe Sheraton Stealth Black Aged Gloss",
    title: "",
    brandName: "Epiphone",
    description:
      "<h2>At A Glance:</h2>\r\n<p>The Epiphone Emily Wolfe Sheraton Stealth Black Aged Gloss is a fantastic looking modern take on a classic Epiphone. It's stealth black look will have you looking cool no matter where you are, and the diamond \"f-holes\" only add to it's modern look. But this guitar isn't all about looks! To keep up with Emily Wolfe's fantastic guitar and song writing chops, this guitar features Epiphone's LockTone hardware, Grover tuners, Graph Tech nut, and a set of Alnico Classic Pro Humbuckers. All ready to take on all the blues and rock tones you need.  </p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Stealth Black</h3>\r\n<p>We think this is an absolutely fantastic look on what would usually be a classic looking guitar. Helped along by thee diamond f-holes <strong>this Sheraton is decked out to be an absolute modern rocker</strong>. </p>\r\n\r\n<h3>SlimTaper Neck</h3>\r\n<p>Whether you're playing at home or at a packed out show like Emily Wolfe frequently is a slim neck can make all the difference for long writing sessions or sets. This SlimTaper C shape neck will <strong>sit comfortably in your hand while you rock away</strong>!</p>\r\n\r\n<h3>Epiphone Humbuckers</h3>\r\n<p>Epiphone are known for their quality and consistently challenge guitars at higher price points. One of the ways they succeed is in their sound, and <strong>this Sheraton is loaded with a set of Alnico Classic Pro humbuckers</strong>. Warm, growly, and punchy everything you want for rock, and easy to clean up for sweet chords.  </p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Any fan of Emily Wolfe will certainly feel at home, but this guitar is designed for any modern rocker with it's sleek look. </p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Modern take on a classic Epiphone</li>\r\n<li>Great sounding pickups</li>\r\n<li>LockTone hardware</li>\r\n<li>Graph Tech nut</li>\r\n</ul>",
    productDetail:
      '<p>Emily Wolfe, a triple-threat rock & roll singer-songwriter-guitarist from \r\nAustin, Texas, is breathing new life into classic rock & roll with her \r\nincendiary guitar chops and original songwriting. Wolfe also lent her creativity \r\nto the development of her new signature Sheraton Stealth. </p>\r\n<p>The Indian laurel fingerboard has 22 medium jumbo frets, and mother of pearl \r\nblock inlays with abalone lightning bolts. The headstock features the popular \r\n60s Kalamazoo shape; it has a mother of pearl tree of life inlay on the front, \r\nEmily\'s Wolfe logo, and a black gloss Emily Wolfe "stealth" signature on the \r\nrear, and it is outfitted with Grover® Rotomatic® tuning machines and a Graph \r\nTech® nut. An Epiphone LockTone™ Tune-O-Matic™ bridge and Stop Bar tailpiece \r\nhold down the other end of the strings and contribute to the impressive sustain \r\nof the instrument. </p>\r\n<p>The electronics include full-sized Epiphone Alnico Classic PRO™ humbucker™ \r\npickups that are paired with CTS® potentiometers for smooth control over \r\nindividual pickup volume and overall tone.</p>\r\n\r\n',
