      "<h2>At A Glance: </h2>\r\n<p>The Admira Virtuoso Electro Cutaway Thin Body classical guitar is a stunning \r\ninstrument built for the wildest forays of classical technique you can dream of. \r\nWith its thinner body profile and cutaway giving access to the high end of the \r\nfretboard, the Virtuoso ECT lets you go wherever the music takes you comfortably \r\nand effortlessly.</p>\r\n<p>Paired with the Solid Cedar top and Fishman Classica Blend pickup and preamp, \r\nthis guitar is built to perform anywhere from the stage to the studio.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Built For Performance</h3>\r\n<p>With its thinner profile and cutaway body, this guitar is built to let you \r\nplay however the music requires, from the bottom of the fretboard to the top, \r\nand do so comfortably and easily in any playing position.</p>\r\n<h3>Quality Tone Woods</h3>\r\n<p>The Solid Cedar Top and Rosewood back &amp; sides lend this guitar a handsome, \r\ncontemporary look with a warm and present tone that'll make your notes sing.</p>\r\n<h3>Quality Electronics</h3>\r\n<p>This guitar comes fitted with the Fishman Classica Blend system, combining an \r\nundersaddle piezo and internal mic allowing you to blend the different signals \r\nbefore running through the quality 3-band EQ. This gives you a huge amount of \r\ncontrol to achieve the perfect recreation of your natural tone.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Features a Thin body profile and cutaway</li>\r\n\t<li>Built to allow comfortable, effortless play the length of the fretboard</li>\r\n\t<li>Solid Cedar top and Rosewood back &amp; sides</li>\r\n\t<li>Fantastic Fishman Classica Preamp</li>\r\n</ul>",
    productDetail:
      "<p>A member of the Admira Supreme family, the Virtuoso is aptly named. Stunning \r\nRosewood and Solid Cedar guarantee a timbre able to the beautiful appearance.</p>\r\n<p>This particular guitar features a cutaway and thinner body for easier access \r\nto the upper frets.</p>\r\n<p>Admira's Electrified range combines all the top-quality characteristics of \r\ntheir classical guitars with the best in electronics to produce guitars that \r\nallow you to amplify and sculpt your sound to deliver the best sounding \r\nperformance.</p>\r\n",
