    description:
      "<h2>At A Glance</h2>\r\n<p>The Everly Brothers, Elvis 'The King' Presley, Emmylou Harris, Bob Dylan... so many \r\nmusical legends have chosen the Jumbo bodied J-200 as their go to acoustic for \r\nit's projection, attitude and wide coverage of frequencies. This classic design \r\nhas also been a huge success for Epiphone and is brought to you here in the \r\nsmaller Coupe model. This makes it perfect for the travelling musician or those \r\nwho prefer smaller bodied guitars. The solid spruce top is accompanied by a \r\ncutaway for high fret access. The Active Pickup \r\nSystem offers up a whole range of possibilties. Grover mini-tuners hold your \r\nnotes tight and true.  </p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Presys II Preamp</h3>\r\n<p>Working in conjunction with the Sonicore pickup is the Presys II \r\npreamp. It features an on-board chromatic tuner, master volume, bass, treble \r\nplus a phase switch. So basically, all the controls you need in order to shape \r\nand fine tune your sound.</p>\r\n<h3>Grover Mini-Rotomatic Tuners</h3>\r\n<p>Featuring an 18:1 ratio, these Grovers are a great addition. They \r\nprovide excellent tuning stability and make string changes quick and easy. No \r\nmatter how hard you are strumming at least you know that these will be holding \r\nyour strings firmly and reliably.</p>\r\n<h3>Smaller Body</h3>\r\n<p>Love the Jumbo but looking for something less cumbersome? The smaller Coupe \r\nbody size makes both transport and comfort of playing a breeze. Whether you \r\nchoose this model due to preference or necessity, having the J-200 in a smaller \r\npackage will be a great addition to your playing regardless. </p>\r\n<h2>Highlight:</h2>\r\n<ul>\r\n<li>A classic looking model in a more compact size</li>\r\n\t<li>Extremely versatile due to the onboard pickup system</li>\r\n\t<li>Epiphone quality components and construction</li>\r\n</ul>\r\n\r\n\r\n",
