    brandName: "Balaguer",
    description:
      '<h2>At A Glance: </h2>\r\n<p>The Balaguer Standard Series Thicket in Gloss White is a wonderful merging of \r\nclassic influences with contemporary needs. At its heart is a T-style design but \r\nwith a modern offset body. This sets the foundation for the impressive \r\nspecifications that make the Standard Series Thicket an updated workhorse for a \r\nnew generation of guitarists. A<strong> roasted maple neck and fingerboard</strong> \r\ngive a premium feel and the 16" radius makes string bending a breeze. A Coil Tap \r\non the Tone makes it very adaptable and with locking tuners, you are all set to \r\nriff the night away!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Feral Humbucker Pickups</h3>\r\n<p>These pickups have been appropriately named! With a 12.5k output for the \r\nbridge humbucker, there is certainly <strong>enough "bite" for some aggressive \r\nriffing</strong>. They build on the Balaguer Evergreen pickup by offering a \r\nhotter signal plus a higher degree of articulation with a harmonically rich \r\nsound.</p>\r\n<h3>Reliable Hardware</h3>\r\n<p>From top to bottom, the Standard Series Thicket has impressive hardware, all \r\nwith the goal of creating an instrument that <strong>plays incredibly well\r\n</strong>and will continue to do so for years to come. Locking tuners and a \r\nHipshot hardtail bridge provide excellent tuning stability and the graphite nut \r\ncertainly plays its part too.</p>\r\n<h3>Stainless Steel Frets</h3>\r\n<p>Taking pride of place on the roasted maple fingerboard are the 22 Medium \r\nstainless steel frets. Ready for a busy touring schedule or demanding studio \r\ntracking, stainless steel frets <strong>go the extra mile</strong>, feel great when bending, and give you that extra peace \r\nof mind.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Ideal for heavier styles of music but can also do much more</li>\r\n\t<li>A great touring guitar that can go the distance</li>\r\n\t<li>Comfortable to play and ready for action</li>\r\n</ul>',
