    title: "",
    brandName: "Martin",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The 000-10E from Martin delivers a great solid-wood guitar at a fantastic \r\nprice. The all-solid Sapele top, back and sides gives you a balanced tone across \r\nthe spectrum that lends itself well to any style of acoustic playing, from big \r\nstrumming to intricate fingerpicking.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>000 Body Size</h3>\r\n<p> The 000 body size lies comfortably between a parlour and a dreadnought. This makes it comfortable in your lap, but still boasts plenty of volume and projection.</p>\r\n<h3>Materials</h3>\r\n<p>The 000-10E's all-solid Sapele construction gives you a guitar with a balanced tone across the spectrum, making it just as good for solo fingerpicking as it is for strumming along in a group. </p>\r\n<h3>Electronics</h3>\r\n<p>The 000-10E features Fishman's  MX-T pickup, which lets you amp up for \r\nbigger live and recording situations, and features a built in soundhole mounted \r\ntuner which mutes the output while you tune. Keeps you sounding good and staying \r\nin tune all night.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>All solid construction and Martin quality, at a fantastic price</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Martin 000-10E Left Handed</li>\r\n\t<li>Gig bag</li>\r\n</ul>",
