    category: "GUAG_1",
    online: true,
    itemName: "TWR2 PE Roadster Parlour Electro Acoustic",
    title: "",
    brandName: "Tanglewood",
    description:
      "<h2>At A Glance: </h2>\r\n<p>Acoustic guitars at budget prices don't need to compromise on quality or \r\nlooks, and the Tanglewood TWR2 PE Roadster Parlour Electro Acoustic is a guitar packed with both. </p>\r\n<p>As part of the Roadster series, the guitar boasts an understated appearance \r\nwith its smoothed edge joins and natural satin finish. Stripped down to the \r\nessentials, this guitar sings!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality Timber Construction</h3>\r\n<p>This guitar features the classic combination of a finely graded Canadian \r\nSpruce top and Indonesian Mahogany back & sides, all sourced from sustainable \r\nforestry projects.</p>\r\n<h3>Parlour Body Size</h3>\r\n<p>The diminutive Parlour body size makes it the perfect guitar for leaving \r\nsitting around the house, or the perfect campfire guitar, while the body size \r\ncombined with the shorter scale makes it ideal for smaller guitarists as well!</p>\r\n<h3>Roadster Styling</h3>\r\n<p>Inspired by nature and sourced from sustainable forestry projects, the \r\nRoadster series sports a stripped back, essentials-only aesthetic with a natural \r\nsating finish that really lets the basic timber shine through.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Delivers stunning quality at a fantastic price</li>\r\n\t<li>Sustainably sourced Spruce Top and Mahogany back & sides</li>\r\n\t<li>Stunning stripped back appearance and natural satin finish</li>\r\n\t<li>Superb Tanglewood TW-EX4 Preamp</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Tanglewood TWR2 PE Roadster Parlour Electro Acoustic</li>\r\n</ul>\r\n",
    productDetail:
      "<P>Parlour guitars, with their diminutive physical dimensions and vintage styling always stand out on a retailers wall, but in reality, this was the original acoustic body shape for scores of years, Dreadnought and Folk and other variants didn’t appear until many years after the Parlour, so they are not quite as rare as we often think.</P>\r\n<P>To compliment the heritage of the parlour shape, we marry a Canadian Spruce top, with Indonesian Mahogany, ensuring we have a great tone, then we brace the top as we would a folk model, so that we get a tremendous sound projection.</P>\r\n<P>This model has an onboard Tanglewood EX4 EQ system, with 4 band graphic, so it can be used live or in the studio, and if you zoom in on the picture you will note the lovely hand inlaid genuine timber rosette which we think finishes the instrument off perfectly.</P>\r\n<P>A classic shape for the discerning player.</P>",
