    productDetail:
      "<P>Our classic and unique Tanglewood shape, the Super Folk cutaway is represented perfectly in this model.</P>\r\n<P>From the warm Spruce top, imported from Canada to the elegantly detailed hand inlaid wood rosette, this instrument oozes understated quality.</P>\r\n<P>The Spruce top gives the guitar an immediate, well voiced, bass rich sound right out of the box.</P>\r\n<P>We love the stripped down, natural look of these guitars, we believe their value for money is outstanding and if you want a stunning contemporary guitar that is all about the sound, you’ve found it here.</P>",
