    itemName: "TWBBOE Blackbird Folk Electro Acoustic",
    title: "",
    brandName: "Tanglewood",
    description:
      "<h2>At A Glance: </h2>\r\n<p>Electro acoustic guitars at budget prices don't need to compromise on quality or \r\nlooks, and the Tanglewood TWBBOE is a guitar packed with both. Featuring \r\nTanglewood Premium Plus electronics, it sounds great whether played acoustically \r\nor plugged in!</p>\r\n<p>As part of the Blackbird series, the guitar is inspired by the cosmetics of \r\nguitars from the 1940s and 50s, including binding designed to replicate the \r\nBakelite of the era, finished off with Tanglewood's rich, smoky charcoal stain \r\n\"Smokestack Black\" finish.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>All Mahogany Construction</h3>\r\n<p>This guitar features an all mahogany body, consisting of a mahogany top \r\nand layered mahogany back & sides. As well as making this guitar robust and \r\ndependable, mahogany as a body wood is known for its pronounced, girth \r\nmidrange, ensuring you'll stand forward in any mix.</p><h3>Premium Plus \r\nElectronics</h3>\r\n<p>The Premium Plus is Tanglewood's freshly designed on-board electronic system. \r\nIt has controls for EQ (bass, treble, middle), presence, phase, volume and a \r\ntuner! </p>\r\n<h3>Blackbird Styling</h3>\r\n<p>The Blackbird series is inspired by acoustic guitars of the 1940s and 50s, \r\npresented here in Tanglewood's stunning \"Smokestack Black\" satin finish and \r\nfeaturing vintage ivory ABS binding, designed to replicate the Bakelite fittings \r\nof the era.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Includes Premium Plus electronics for plug and play simplicity</li>\r\n\t<li>Superb, dependable all mahogany construction</li>\r\n\t<li>Gorgeous \"Smokestack Black\" finish</li>\r\n</ul>\r\n<h2>What's Included:</h2>\r\n<ul>\r\n<li>Tanglewood TWBBOE Blackbird Folk Electro Acoustic</li>\r\n</ul>\r\n",
    productDetail:
      "<p>Building on the global success of their Crossroads range of instruments, \r\nTanglewood's design team have created a whole new range of guitars, inspired by \r\nthe cosmetic of 1940/50’s era US instruments with the class leading \r\nconstructional signature of Michael Sanden and the Tanglewood artisanal team.</p>\r\n<p>Every Blackbird model is carefully braced to provide a tight bottom end bass \r\nnote and clear rich high spectrum resonance.</p>\r\n<p>They have bound each model in vintage ivory ABS materials to provide the look \r\nof Bakelite from the 40’s, and though this won’t affect the sound, it certainly \r\nhelps give provenance to the historic look Tanglewood's design team wished to \r\ncapture, and to their mind, they've have done a wonderful job.</p>\r\n<p>They have both traditional acoustic models and stage ready electro acoustic \r\nversions available, all featuring the outstanding new Tanglewood Premium Plus Eq \r\nsystem as standard equipment.</p>\r\n<p>The rich smoky charcoal stained finish they have christened “Smokestack \r\nBlack“ and they hope, amongst the range you will be able to choose your own \r\nfavourite!</p>\r\n",
