    online: true,
    itemName: "Venus HiGloss Three Piece Back FVHG3",
    title: "",
    brandName: "Faith",
    description: "",
    productDetail:
      "<p>Faith HiGloss series have always been designed to offer both visual and aural beauty, and with the updating to HiGloss-3, we’re sure you’ll agree these wonderful instruments will continue to inspire musicians for generations to come.\r\n\r\n<p>Using a more sustainable 3-piece, solid rosewood back design, we can ensure that these incredibly popular models are available longer-term and yet retain all the tonal and visual punch that HiGloss-series afficianados have come to expect. Using high grade Englemann Spruce for the top and highly-figured, 3-piece Rosewood bound in Flamed Maple for the back and sides, HiGloss-3 models also feature solid Flamed Maple binding on the front and use stripy Indonesian Ebony for the fingerboard, bridge, headplate and heelcap.</p>\r\n\r\n<p>Tonally, this combination of wood is generally bright and ‘zingy’, delivering great clarity. Visualising this as a frequency curve, it would be shaped like a smile: high on the bass, dipping down through the middle and rising once again at the top end. Therefore greater string separation and articulation is achieved, lending itself to fingerstyle and solo pieces in particular.</p>\r\n\r\n<p>This Faith Guitar is fitted with the refined, low-profile Fishman INK3 preamp system with the Sonicore piezo pickup located under the saddle. The preamp features a chromatic tuner, 3 band EQ and volume control. The output jack is located at the base of the guitar as part of the ingenious, easy-access battery compartment. All HiGloss series Faith Guitars are complete with a Faith Hardcase.</p>\r\n\r\n<p>The Venus is the now iconic shape that brought Faith Guitars to the consciousness of so many players over the years. The combination of a 15\" lower bout and a slimmer depth of body looks to classic OM or Auditorium body-shapes for inspiration, and makes the Venus the perfect compromise. In fact, the Naked Venus was voted 'The UK's Best Acoustic Guitar' at the MIA Music Awards in 2013.</p>\r\n\r\n<p>It is still big enough to deliver a big acoustic performance, yet remains small enough for the player to jump around on stage with no problem.</p>",
