    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sigma 000MC-15E Left Handed combines traditional style with some modern \r\nfeatures. Benefits include a smooth cutaway for greater upper fret access, \r\nFishman electronics and an admirable level of craft. It's hard to imagine how \r\nthey managed to do all of this without it costing far more but we are very \r\nimpressed that they have!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>All Mahogany</h3>\r\n<p>This 000MC-15E has been constructed using mahogany for the top, back, and sides, as well as the neck! Loved for its warm sound and dependable construction, this is an excellent choice.</p>\r\n<h3>Fishman Presys II</h3>\r\n<p>It sounds great acoustically but what if you want to plug in? The Fishman \r\nPresys II takes care of that. Easily connect to an amplifier for live performance or for direct recording. The Bass and Treble controls allow you to dial in the exact tone you need.</p>\r\n<h3>And a Tuner?</h3>\r\n<p>The Presys II also has an inbuilt tuner. This is great for quickly checking \r\nyour tuning, no matter where you are. It's quick, easy to see, and very accurate!</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>A natural look from lovely mahogany wood grain</li>\r\n\t<li>Great for live use thanks to the Presys II</li>\r\n\t<li>A warm sound that lends itself well to a number of styles</li>\r\n</ul>\r\n\r\n\r\n\r\n",
