    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sigma DM-SG5 is a well crafted vintage inspired instrument. With a clearly identified influence the Sigma DM-SG5 does well to carve out its sound and tone. Loaded with premium features like Grover Tuners, and Fishman Sonitone electrics this great sounding dreadnought guitar comes in at a surprising price with all its features. </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Mahogany Back & Sides </h3>\r\n<p>A classic wood selection and one that's very welcome on a guitar at this price. Providing a warm and resonant tone that combined with the dreadnought body style can produce a loud sound to make sure you're heard by everyone. </p>\r\n<h3>Solid Sitka Spruce Top</h3>\r\n<p>A great combination wood for the mahogany back and sides, a solid Sitka spruce top provides a classic tone and strong resonance that can be felt throughout the guitar. It's important to have a great wood selection and with this solid top you can't go wrong.  </p>\r\n<h3>Fishman Electronics</h3>\r\n<p>A nice upgrade to make sure that even when you're plugged in you've got reliable great sounding tones. Fishman are one of the leaders in acoustic amplification and having them on this guitar is a sure sign of quality. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Fishman Electronics</li>\r\n<li>Grover Tuners</li>\r\n<li>Great wood selection at an affordable price</li>\r\n\r\n</ul>\r\n\r\n\r\n",
