    itemName: "DM-15E Aged",
    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sigma DM-15E Aged is an affordable vintage inspired acoustic. Keeping the same principles of high quality and affordability that comes with the Sigma 15 series, the aged series features a distressed satin finish. Perfect for those who like the worn in look of a vintage instrument. </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Fishman Electronics</h3>\r\n<p>It's not all distressed though, with some very modern electronics. The Fishman Presys II preamp offers an unobtrusive system with plenty of flexibility for your tone. With EQ for Bass and Treble, along with a Phase switch, Master Volume, and even a Tuner! The Fishman Presys II should have you covered for all eventualities. </p>\r\n<h3>Aged Finish</h3>\r\n<p>One of the standout features for this model is the distressed satin finish. We all like the feel of a new guitar but who doesn't love the look of a vintage instrument? Now you can have both! This satin finish feels great under the hands and although the guitar has a worn in, distressed look, it doesn't affect the hardware or playability, you still have a great playing guitar in your hands. </p>\r\n<h3>Mahogany Construction </h3>\r\n<p>Mahogany, top, back, sides, and neck, you can't go wrong. Producing a warm resonant tone that pairs well with the vintage look of the instrument. It works paired with the Dreadnought shape able to produce a warm but powerful sound when you need it. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>All mahogany construction</li>\r\n<li>Fishman electronics</li>\r\n<li>Grover tuners</li>\r\n<li>Vintage inspired finish</li>\r\n</ul>\r\n\r\n\r\n",
