    title: "",
    brandName: "Epiphone",
    description:
      "<h2>At A Glance: </h2>\r\n<p>Based on Mr King's own iconic Gibson, the Epiphone B.B. King Lucille Ebony \r\ndelivers the original's unmistakable look and profile at a fantastic price.</p>\r\n<p>This is one feature-laden guitar, sporting the classic Gibson ES style body \r\nwithout F-holes, one of BB's own specific requests to cut down on feedback. The \r\nelectronics are very impressive, with a pair of Alnico Classic PRO humbuckers, \r\nwired to CTS pots, with Mono and Stereo outputs and a 6-Position Varitone Switch \r\nfor MAXIMUM tonal versatility. The Epiphone Lucille is also fitted with \r\nEpiphone's top hardware appointments such as the \r\nEpiphone LockTone Tune-O-Matic bridge and TP-6 Stop Bar with Fine Tuners for \r\ncomplete tuning precision and stability.</p>\r\n<p>The  Epiphone B.B. King Lucille Ebony is built to take you everywhere \r\nfrom smooth jazz tones, to serious rock& roll sounds, to making your axe cry \r\nwith the Blues, just like B.B. This guitar also comes supplied with Epiphone's \r\nEpiLite case.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Unmistakable Style</h3>\r\n<p>It's the Lucille! B.B King's signature Gibson ES is unmistakable with its \r\nwhite bound, ebony black body with gold hardware and no f-holes, and this \r\nEpiphone model recreates this style perfectly.</p>\r\n<h3>Powerful Electronics</h3>\r\n<p>Versatility and quality of tone is the name of the game here. A pair of \r\ngorgeous Alnico Classic PRO humbuckers are wired to top quality CTS volume and \r\ntone pots, a 6-position Varitone switch (essential for some of Mr King's classic \r\nsounds) and both Mono and Stereo outputs.</p>\r\n<h3>Top Drawer Hardware</h3>\r\n<p>The Epiphone B.B. King Lucille Ebony isn't just about great looks and sounds, \r\nthis guitar is built tough and built to perform. Some of the top hardware \r\nappointments in Epiphone's trick bag are featured here, including the Epiphone LockTone Tune-O-Matic bridge and TP-6 Stop Bar \r\nwith Fine Tuners for complete tuning precision and stability.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Faithfully recreates the classic look and style of BB King's signature \r\nguitar, Lucille</li>\r\n\t<li>Boasts some of Epiphone's top hardware appointments</li>\r\n\t<li>Stunningly powerful and versatile electronics, including the 6-Position \r\n\tVaritone switch, an essential for nailing BB's tone!</li>\r\n</ul>",
