    title: "",
    brandName: "PRS",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The PRS SE P20E Parlor Pink Lotus is a Limited Edition version of this \r\nmuch-loved model. With its compact size and excellent build quality, the SE P20E \r\nParlor is a top choice for those seeking a small bodied acoustic that \r\nstill packs a punch. While it sounds great unplugged, the option of plugging in \r\nthanks to the Fishman GT1 means you can easily use it for recording or live \r\nperformance without needing a microphone. There's a lot of love out there for \r\npink guitars and we're glad PRS SE P20E got to join that club too!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Solid Mahogany Top</h3>\r\n<p>A solid top is what sets apart a serious acoustic from lower models. The use \r\nof mahogany here produces <strong>a warm and rich tone</strong> that delivers a \r\nsound far larger than what you'd expect from a parlor sized guitar.</p>\r\n<h3>Limited Edition</h3>\r\n<p>This Limited Edition version comes in a<strong> stunning Pink Lotus finish</strong>. \r\nIt contrasts beautifully with the pickguard and is framed perfectly by the \r\nbinding. As with all Limited Edition PRS SE models, we can't see them sticking \r\naround for long!</p>\r\n<h3>Fishman Electronics</h3>\r\n<p>The PRS SE P20E is equipped with the Fishman GT1 pickup system which includes \r\nan undersaddle pickup and soundhole mounted preamp. The GT1 is an excellent \r\nchoice as it <strong>captures the natural sound of the guitar</strong> \r\nwhich really helps to bring out the best in your playing.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Limited Edition model with a gorgeous Pink Lotus finish</li>\r\n\t<li>Comfortable size that still packs volume</li>\r\n\t<li>Excellent construction throughout</li>\r\n</ul>",
