    itemName: "X Series GPCX2E-01 Sitka Spruce/Mahogany Left Handed",
    title: "",
    brandName: "Martin",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The X Series GPCX2E-01 is a beautiful Grand Performance guitar from Martin. This is a large-bodied guitar with a rich booming tone and features a stunning Sitka spruce top, \r\nfigured mahogany back and sides, Martin's X-Brace bracing system, a high-performance taper neck and a Fishman MX pickup. This grand example of the X Series would make a good investment for students or reliable gigging guitar for professional musicians. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Grand Performance Body</h3>\r\n<p>Martin's Larger Grand Performance body creates a rich tone with plenty of depth, clarity and character. The larger body also makes it great for strumming, giving a consistent volume and even tone without impacting your dynamic range.\r\n</p>\r\n\r\n<h3>Martin X-Brace</h3>\r\n<p>Martin's X-Brace system dates back almost 200 years, designed to present the perfect balance between reliability and optimised tonal quality, in a guitar that will last a lifetime. The X-Brace design supports the guitar's soundboard without negatively impacting the guitars natural resonance and character.\r\n</p>\r\n\r\n<h3>Fishman MX Pickup</h3>\r\n<p>Fishman have a reputation as one of the best pickup manufacturers in the world and their acoustic guitar pickups are especially loved. The MX series pickup offers exceptional transparency to present the true sound of your guitar to a speaker system. The system also features a volume and tone control neatly tucked into the soundhole, so there are no ugly control panels screwed onto the body. It looks like a traditional acoustic with the control and convenience of an electro-acoustic, truly the best of both worlds. \r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Great sounding and reliable guitar</li>\r\n<li>Fishman pickup makes gigging easy\r\n</li>\r\n</ul>\r\n\r\n\r\n",
    productDetail:
      "This Grand Performance sized model features a cutaway body with high-pressure laminate (HPL) back and sides. New mother-of-pearl pattern inlay on the rosette and fingerboard lend a richness to the GPC-X2E, making it as impressive to look at as it is to play. With a Performing Artist neck, fingerboard, and bridge of select hardwood, the sound transfer of this model has been greatly improved. It is equipped with Fishman® MX electronics and strung with Martin’s Authentic Acoustic Lifespan® 2.0 strings. With a new, soft gig bag featuring headstock, bridge, and endpin protectors, a durable water-repellent exterior, and foam padding, this model is ready to go anywhere.",
