    description:
      "<h2>At A Glance: </h2>\r\n<p>The Washburn HD10S is a modern and affordable dreadnought acoustic. Opting for premium hardware which gives it an edge over most affordable instruments this Washburn is ready to provide a great tone and feel to any player. The mahogany and sitka spruce combination body creates a traditional and  familiar tone.   </p>\r\n<h2>Features We Love:</h2>\r\n<h3>GraphTech Nut </h3>\r\n<p>For the nut Washburn have opted for GraphTech NuBone material. Similar to GraphTech's premium TUSQ material this NuBone is a great upgrade upon the standard plastic nuts and saddles you find on many affordable instruments. NuBone is easy to work with for setups and transfers a greater amount of frequencies to the wood and rest of the instrument than plastic, <strong>helping your guitar stay as vibrant as possible</strong>.  </p>\r\n<h3>Quality Woods</h3>\r\n<p>It may be an affordable instrument but what sets this Washburn apart is its commitment to quality woods at this price. The Spruce top combined with mahogany back and sides gives not only a great tone but also an inspiring look that makes you want to pick it up over and over again. </p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>GraphTech hardware</li>\r\n<li>Very affordable price</li>\r\n<li>Solid Top</li>\r\n\r\n</ul>\r\n\r\n\r\n",
