    itemName: "Elvis Dove Ebony",
    title: "",
    brandName: "Gibson",
    description:
      '<h2>At A Glance</h2>\r\n<p>The Gibson Elvis Dove in Ebony is a lovely acoustic with a style of its own. \r\nElvis fans will likely recognise this model, and it certainly looks very \r\nsophisticated with its Ebony finish and contrast binding. Crafted from Sitka \r\nspruce and maple, it produces a warm and balanced tone while the mahogany neck \r\nis a joy to play thanks to its Rounded profile. </p>\r\n<p>The 12" radius gives it a familiar feel, so whether you choose to use it to \r\nplay through hits from Elvis Is Back! or want a new acoustic for your own \r\nperformance, this well-crafted Elvis Dove from the skilled luthiers at Gibson \r\nwould make an excellent choice.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Based on the Original</h3>\r\n<p>Back in 1969, Elvis was gifted a customized Gibson Dove by his father. He \r\nregularly used that guitar on stage from 1971 through to 1975, including during \r\nthe famous Aloha From Hawaii TV performance. He gifted it to a member of the \r\ncrowd in 1975, yet again proving why he was The King. This guitar is based on \r\nthat original and successfully<strong> brings back some of that special magic</strong>.</p>\r\n\r\n<h3>Gorgeous Details</h3>\r\n<p>From the Mother of Pearl inlays on the rosewood fingerboard and bridge to the \r\n"ELVIS" truss rod cover, this guitar is <strong>full of beautiful appointments</strong> \r\nthat make you appreciate how much thought, time, and skill has gone into its \r\ncreation.</p>\r\n\r\n<h3>LR Baggs VTC</h3>\r\n<p>This premium pickup system is all about Volume, Tone, and Compression. With \r\nCompression often being the secret to great tone in the studio, LR Baggs has \r\ndeveloped an acoustic pickup system that utilises compression tuned to key \r\nfrequencies of the acoustic guitar to deliver <strong>a professional quality \r\nsound</strong> no \r\nmatter where you are. </p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Obviously fans of The King will love this Dove but with its classy yet \r\nunderstated look and excellent pickup system, it would greatly benefit any \r\nperforming acoustic guitarist.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Crafted to perfection</li>\r\n\t<li>Sounds incredible, acoustically and thanks to the LR Baggs electronics</li>\r\n\t<li>A must-have for any Elvis fan</li>\r\n</ul>',
