    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sigma S000M-10E Sitka Spruce / Mahogany is an all-solid wood acoustic \r\nfrom their Crossroad Series. Each guitar in this range benefits from excellent \r\nsolid wood choices, LR Baggs electronics and an impressive level of craft. This \r\nmodel is their 000-14 Fret body size which is extremely comfortable to play. \r\nHardware includes Grover tuners and a bone nut and saddle. With a traditional \r\nlook and sound, it'll be at home in any style of music and performs just as well on \r\nstage as it does in the studio.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>All-Solid Woods</h3>\r\n<p>Solid woods have long been the recipe for a <strong>professional grade sound\r\n</strong>and that rings true here. The solid Sitka spruce top brings out the \r\ndetail of each note across every string. Solid mahogany back and sides add an \r\noverall sense of warmth while allowing the mid frequencies to really shine.</p>\r\n<h3>LR Baggs Electronics</h3>\r\n<p>LR Baggs are one of the best around when it comes to top quality electronics \r\nfor acoustics. It is reassuring to know that anytime you need to plug in, you \r\ncan <strong>be heard with clarity</strong> while still keeping that organic tone \r\nthat makes these guitars so great.</p>\r\n<h3>A Classy Appearance</h3>\r\n<p>Some of the features that add to the gorgeous look of this guitar are the \r\ndiamond-pattern rosette, pearl fingerboard inlays and a tortoise shell style \r\npickguard. These small details add just <strong>the right amount of class</strong> \r\nwithout overshadowing the natural beauty of the wood.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>A timeless look that blends traditional with a little extra luxury</li>\r\n\t<li>All-solid woods for a premium level of sound</li>\r\n\t<li>LR Baggs electronics make live performance and recording simple, no \r\n\tmatter the setup</li>\r\n</ul>",
