      "<h2>At A Glance: </h2>\r\n<p>The Balaguer Select Series Toro Classic HSS is Balaguer's take on the classic California-built \r\ndouble cutaway, with a versatile HSS pickup configuration, gorgeous roasted \r\nmaple neck and fingerboard and classically reliable hardware throughout. This \r\nexceptional axe is built to handle basically any playing style or genre you \r\nsling it at!</p>\r\n<p>The Alder body gives you that classic s-style spank and responsiveness, and \r\nfeatures comfortable contouring ensuring playing is a breeze. The versatile \r\npairing of Balaguer's own Feral humbucker in the bridge position with their Ebb \r\nsinglecoils in the middle and neck leaves you setup perfectly for everything \r\npunk to blues to fusion to hard rock and anywhere in between. The super flat 16\" \r\nfingerboard radius is built for speed, further cementing the versatility of this \r\nguitar, while the 18:1 ratio locking tuners keep you solidly in tune with every \r\nflutter and dive of the Wilkinson WVS1302P Tremolo.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Built For Any Style</h3>\r\n<p>The classic double-cutaway Alder body knows where its inspiration lies, and \r\nBalaguer's take on this classic sports every bit of quality and capability one \r\nexpects from Balaguer. The quality electronics, versatile HSS pickup set and 16\" \r\nradius fingerboard make the Toro HSS every bit as at-home playing jazz fusion as \r\nblues or punk.</p>\r\n<h3>Quality Assured in the USA</h3>\r\n<p>Each and every Balaguer guitar undergoes a full quality assessment and set up \r\nat their HQ in Pennsylvania, USA,<strong> ensuring you receive a guitar that \r\nmeets their high standards straight out of the box.</strong></p>\r\n<h3>Pickups</h3>\r\n<p>This guitar is <strong>versatile. </strong>The bridge position Feral \r\nhumbucker has a high output that growls and snarls as much as you could want, \r\nwhile the Ebb singlecoils in the middle and neck positions give you all the \r\nclean, bell-like jangle or smooth lead sounds you could want from a classic \r\n3-pickup configuration!</p>\r\n<h2>Pros:</h2>\r\n<ul>\r\n<li>Balaguer's take on a classic</li>\r\n\t<li>Versatile HSS pickup set</li>\r\n\t<li>Rock solid, dependable hardware throughout</li>\r\n\t<li>Gorgeous Roasted maple neck and fingerboard</li>\r\n</ul>",
