    itemName: "Artist Series AG60-8CESHB 8 String Baritone Shadow Burst",
    title: "",
    brandName: "Alvarez",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Alvarez Artist Series 8 String Baritone in Shadow Burst, is a unique guitar with a voice all of it's own. With 8 strings it's sound is unlike most acoustics around, and coupled with the high quality design that is present with every Alvarez it has a charming and captivating sound. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>8 Strings</h3>\r\n<p>One of the first things you'll notice with this Alvarez is the 8 strings. Adding extra sparkle and body to the sound this guitar outshine most others. No daunting task either, the extra strings next to the D and G strings take no time at all to get used to and you can set about unleashing this guitars <strong>signature sound</strong>. \r\n</p>\r\n<h3>Bi-Level Bridge</h3>\r\n<p>You'll notice on most Alvarez guitars the interesting bridge design. This is based on the design of master luthier  Kazuo Yairi, a design which is used in various forms across the Alvarez lines. This bridge increases string tension across the saddle and therefore increases response and sound projection of the guitar. This unique bridge design <strong>gives Alvarez a sound of their own</strong>. \r\n</p>\r\n<h3>Electronics</h3>\r\n<p>LR Baggs' powerful tone shaping Stage Pro EQ system is coupled with their innovative Element pickups. Which reproduces the vibration of your guitars top to pick up its most subtle nuances. This pairing gives you a guitar that <strong>sounds amazing plugged in</strong>, straight out the box!\r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>8 string design</li>\r\n<li>Comfortable body shape</li>\r\n<li>Powerful tone shaping capability in the LR Baggs EQ and pickup so you sound great plugged in.</li>\r\n<li>Unique bridge design heightens response and sound projection</li>\r\n</ul>\r\n\r\n\r\n",
