      "Masterworks MDR70ESB 12th Fret Round Shoulder Electro Acoustic Vintage Sunburst",
    title: "",
    brandName: "Alvarez",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Alvarez Masterworks MDR70ESB, seamlessly blends traditional modern styling. Quality woods and a great helping of both modern and traditional styling will have you turning heads for looks and sound with this acoustic. The slotted headstock gives off a great vintage look coupled with the sunburst finish. Combined with Alvarez guitars innovative features such as the bi-level bridge design you have a guitar that looks great and sings with it's own unique voice. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality Woods</h3>\r\n<p>Solid AAA North American Sitka Spruce tops off this guitar, and coupled with the solid rosewood back and sides you have a wonderful traditional tone. Adding in a mahogany neck it's hard to find many guitars at this price with such quality when it comes to the wood selection. <strong>Alvarez always strive to provide quality for your money</strong>. \r\n</p>\r\n<h3>Bi-Level Bridge</h3>\r\n<p>You'll notice on most Alvarez guitars the interesting bridge design. This is based on the design of master luthier  Kazuo Yairi, a design which is used in various forms across the Alvarez lines. This bridge increases string tension across the saddle and therefore increases response and sound projection of the guitar. This unique bridge design <strong>gives Alvarez a sound of their own</strong>.</p> <h3>Electronics</h3>\r\n<p>The LR Baggs VTC pickup system is as premium as this guitar looks. Aiming to combat the \"Quack\" found with many acoustic pickup systems the VTC derives it's output from the soundboard, and rejects pick attack. The flexible film of the pickup responds to the vibration of the soundboard and <strong>recreates every delicate nuance of your playing</strong>. \r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Unique Bi-Level bridge design</li>\r\n<li>High quality woods</li>\r\n<li>Comfortable body shape</li>\r\n<li>Premium quality LR Baggs electronics</li>\r\n</ul>\r\n\r\n\r\n",
