    online: true,
    itemName: "SDM-SG5",
    title: "",
    brandName: "Sigma",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sigma SDM-SG5 combines a traditional acoustic guitar design with luxury \r\nlooks and high-quality construction. Featuring LR Baggs electronics, Grover \r\ntuners and excellent wood choices throughout, no corners have been cut here. \r\nThis is a great choice for songwriters and live acoustic performers after an \r\nextra-special dreadnought sized guitar with an eye-catching appearance.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Solid Woods</h3>\r\n<p>The SDM-SG5 makes use of a classic wood pairing for a well balanced and clear \r\nsound. Constructed from Sitka spruce and mahogany, it features <strong>solid \r\ntop, back and sides</strong>, giving you a high-quality instrument that has been \r\nmade to last.</p>\r\n<h3>Luxury Appointments</h3>\r\n<p>From the classy inlays to the beautifully decorated pickguard, this is a \r\nguitar that <strong>goes the extra mile</strong> to impress on a visual level. \r\nThe binding frames the Autumn Burst finish and completes the look.</p>\r\n<h3>LR Baggs Electronics</h3>\r\n<p>The LR Baggs Anthem pickup is not only discreet but gives you<strong> an \r\nincredible plugged in tone</strong> that retains the character of the guitar. It \r\nis in keeping with the high-quality seen in every other aspect of the SDM-SG5 \r\nand is a must-have for a professional live performance.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>A rich and organic tone from the solid woods</li>\r\n\t<li>Its good looks make you want to pick it up and play every chance you get</li>\r\n\t<li>Well crafted from a trusted brand</li>\r\n</ul>",
