    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Taylor Limited Edition GS Mini-e Quilted Sapele is a compact, versatile instrument. It is slightly smaller than the average acoustic but does it certainly not lack power! It is perfect for everyday use or for taking on the road. This limited-edition model features a gorgeous quilted Sapele back for a distinctive tone and outstanding look. </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quilted Sapele</h3>\r\n<p>The real character of this model comes from the special quilted Sapele back and sides. Very similar to mahogany tonally, with <strong>a detailed low end and rich, growly midrange</strong>. Though Sapele differs in that it has a brighter top end giving you great definition, on top of looking absolutely great!\r\n</p>\r\n\r\n<h3>Sitka Spruce Top</h3>\r\n<p>Sitka spruce is one of the most popular tonewoods used on modern acoustic guitars. It's loved for its bright character which <strong>brings clarity and detail to your playing</strong>. \r\n</p>\r\n\r\n<h3>Versatile Body Size</h3>\r\n<p>The scale length is 23 1/2 inches, making it a little smaller than a standard acoustic. This size lends it to a large variety of playing styles and makes it appealing to a great number of players. On top of being versatile <strong>this size offers a lot of comfort</strong> whether you're playing on the sofa or the stage!</p>\r\n<h3>Taylor ES-B Pickup</h3>\r\n<p>This particular model comes pre-fitted with Taylor's own specially created Mini-e pickup. This custom pickup system translates every ounce of tone, detail, and dynamics from your fingertips, strings, and guitar wood. It gives the audience an accurate and fully realistic translation of your performance. What's more, is it comes with a built-in digital tuner which is always handy!</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Full, powerful sound despite its slightly cut-down size</li>\r\n<li>Warm, strong tone</li>\r\n<li>High quality yet affordable</li>\r\n<li>Comfortable and compact size</li>\r\n<li>Works great as a travel guitar</li>\r\n<li>Limited edition tonewoods</li>\r\n</ul>\r\n\r\n",
    productDetail:
      "The GS Mini is a staple of the acoustic guitar world because of its bold voice and \r\nportable, playable size, and this limited-edition model continues that tradition in a new \r\npackage featuring beautiful quilting in the back and sides. Layered quilted sapele brings \r\na lustrous visual dimension, adding an alluring organic appeal that elevates the GS Mini’s \r\nspontaneous personality. Players will hear rich projection and clarity with enough power to \r\ncut through an instrument mix, making this model a great choice not just for practicing at \r\nhome or on the road, but also for playing with other musicians. Onboard ES-B electronics \r\nmake plugging in easy, and with the built-in digital tuner, players will have everything they \r\nneed for an inspiring playing experience.",
