      "<p>The F-2512E Maple combines two of Guild’s most iconic specialties: twelve string and jumbo guitars. With their large, rounded bodies, jumbo acoustic guitars have been Guild’s forte since 1954; combining this shape with the ever-popular 12-string construction results in a full-toned, impressively voiced acoustic instrument. Built with a solid spruce top, maple sides, and arched maple back, the F-2512E Maple has the bright, jangly tone characteristic of Guild’s twelve string guitars. Guild’s signature arched back design allows for great volume and projection, long sustain, and a lush, full sound. The F-2512E Maple features Guild’s Fishman-designed AP-1 electronics, a pau ferro fingerboard and bridge, bone nut and saddle, pearl rosette, period-correct tortoiseshell pickguard, and a satin polyurethane finish.</p>",
