    title: "",
    brandName: "Eastman",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Eastman Traditional Series E3DE Dreadnought is a finely \r\ncrafted, extremely aesthetic acoustic guitar. The luthiers at Eastman are \r\ndedicated to exceptional craftsmanship, giving each instrument they create a \r\nlife of it's own by applying careful attention to detail and unique features \r\nsuch as hand-scalloped bracing and precision tap tuning.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Great Wood Choices</h3>\r\n<p>With a Solid Sitka Spruce top and Solid Ovangkol back and sides you have a guitar that sounds incredible, \r\nbut is also<strong> robust and sturdy enough to withstand the rigors of years \r\nof practice and playing</strong>, the Ebony fingerboard also provides a \r\nwell-rounded, present tone that's hard to ignore.</p>\r\n\r\n<h3>Hand-Scalloped Bracing</h3>\r\n<p>Each guitar and tonewood is slightly different, and a uniform bracing profile \r\namong a series of guitars will inevitably leave some guitars sounding less than \r\nwhat they could be,<strong> hand-scalloped bracing ensures that each guitar \r\nreaches their maximum potential</strong>. By crafting the bracing to suit each \r\nguitar individually, Eastman are maximizing the quality of all their guitars.</p>\r\n\r\n<h3>Prime Aesthetics</h3>\r\n<p>Eastmans practice of fine craft and attention to detail extends beyond the \r\nguitars sound quality, with<strong> carefully selected tonewoods and masterful \r\nconstruction this instrument looks incredible</strong>, and would easily take \r\npride of place in your living room.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Whether you're a bedroom guitarist, or are gigging regularly, Eastman guitars \r\nhave a lot to offer. Eastman guitars punch well above their weight, and you'll \r\nfind yourself playing this for years to come.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Exceptional Tonewoods</li>\r\n\t<li>Hand-Scalloped Bracing for Optimal Sound</li>\r\n\t<li>Clean Aesthetics</li>\r\n\t<li>Fishman Sonitone Electronics</li>\r\n</ul>",
