    itemName: "AN1E Silky Oak #210912679",
    title: "",
    brandName: "Cole Clark",
    description:
      "<h2>At A Glance: </h2>\r\n<p>This Cole Clark AN1E Silky Oak, is a true performers guitar. Cole Clark guitars are designed to be the best sounding acoustic guitars when plugged in. With their proprietary pickup system, you can certainly hear how much time and expertise has gone into the design and sound of these instruments. Plugged in the guitars sound incredibly natural as if listening to a mic'd up acoustic itself. Combined with sustainable Australian timbers and unique construction features, these guitars are one of a kind.   </p>\r\n<h2>Features We Love:</h2>\r\n<h3>Sustainable Australian timber</h3>\r\n<p>Across the Cole Clark line you'll find all the wood used is not only sustainable but comes directly from Australia, cutting down on their climate impact. In addition to this we're given access to tonewoods you don't usually find on acoustic guitars. This Silky Oak gives off a rounded tone, with a great balance.</p>\r\n<h3>Cole Clark Pickup System</h3>\r\n<p>The pickup system in these guitars is second to none. Developed to help you sound as natural as possible when plugged in and eliminate problem frequencies and tonalities that can so often plague electro-acoustic guitars. Starting with 6 piezo elements under the bridge which focus on the low-end frequencies, then a face sensor that covers your mid to high end starting at 350Hz. Finally a condenser microphone covers the high end above 2.5kHz. Combined and fully customizable with the blend controls this <strong>creates an incredibly natural sound</strong>, that picks up everything even the sound of your hand against the neck. </p>\r\n<h3>Unique Construction</h3>\r\n<p>Once the pickup system was made Cole Clark designed the guitar around it. This has let to some unique construction methods, again in an effort to create the best performance acoustic guitars on the market. Notably, the guitar features a Spanish style heel construction. This means the neck is made, and then the body top is joined followed by the back and sides. Altogether meaning the neck is 1 piece all the way to the soundhole, <strong>creating an incredibly resonant instrument</strong>.  </p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Professional musicians and players who like the feel of a hand crafted instrument. </p>\r\n\r\n\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Sustainable Australian timber</li>\r\n<li>Very natural sounding pickup</li>\r\n<li>Unique construction method</li>\r\n<li>Top quality hardware</li>\r\n</ul>\r\n",
    productDetail: "",
    salesPrice: 999.0,
    pictureMain:
      "https://images.guitarguitar.co.uk/cdn/large/170/211020375703025-7562571f.jpg",
