    title: "",
    brandName: "Tanglewood",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Tanglewood Winterleaf 12 String Autumn Vintage Burst, is an affordable and classy looking electro-acoustic. With all mahogany construction it has a warm voice which is amplified by the sparkle of the 12 string design. Complete with Tanglewood's Premium Plus electronics this guitar is a versatile player for the modern guitarist.  </p>\r\n\r\n<h2>Features We Love:</h2>\r\n<h3>All Mahogany Construction</h3>\r\n<p>This guitar features an all mahogany body as well as making this guitar robust and \r\ndependable. Mahogany as a body wood is known for its pronounced,\r\nmidrange <strong>ensuring you'll stand forward in any mix</strong>.</p>\r\n<h3>Premium Plus Electronics</h3>\r\n<p>The Premium Plus is Tanglewood's freshly designed on-board electronic system. \r\nIt has controls for EQ (bass, treble, middle), presence, phase, volume <strong>and a \r\ntuner</strong>! </p>\r\n<h2>Who Is It For?</h2>\r\n<p>Those looking for an affordable but quality electro-acoustic guitar with a classy look. The Mahogany construction combined with 12 string design creates a wonderfully full sound.  </p>\r\n\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Includes Premium Plus electronics for plug and play simplicity</li>\r\n\t<li>Superb, dependable all mahogany construction</li>\r\n\t<li>Super Folk body has excellent projection</li>\r\n</ul>\r\n\r\n",
    productDetail:
      "<p>Our Winterleaf Super Folk Cutaway 12 string has been carefully honed over the years to give the exact blend of long life performance and tonal clarity.</p>\r\n\r\n<p>We choose North American Sitka Spruce for our tops, a hardy, super strong, renewably sourced timber that is perfect for taking the pressure and strain that a 12 string guitar generates on the top.</p>\r\n\r\n<p>We create each Sitka top from laminated spruce on this model to further strengthen the soundboard and the results, both in its constructional efficiency and tonal supremacy are class leading we believe.</p>\r\n\r\n<p>Because it’s a Winterleaf model, we feature Grover machines for precise tuning, (a very important feature on a 12 string!) and we make the model look contemporary through our classic Tanglewood Super Folk styling.</p>",
