    title: "",
    brandName: "Fender",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Fender Player Plus Meteora HH 3 Colour Sunburst Maple Fingerboard is an \r\nexciting addition to the series. Since their release, the Player Plus range of \r\nguitars have given gigging musicians a hot-rodded option of modern features on \r\nclassic designs. The Player Plus Meteora gives you those excellent upgrades such \r\nas locking tuners, an S-1 switch for coil splitting, and brushed steel block \r\nsaddles. Where it differs though is its bold body shape and Fireball pickups. \r\nThis is one for those looking to step out from the crowd, both in style and with \r\ntheir music.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Fireball Humbuckers</h3>\r\n<p>Full of attitude, the set of Fireball humbuckers add some real power to the \r\nPlayer Plus Meteora. <strong>Excellent for overdrive and distorted tones</strong>, \r\nthey also have enough clarity for notes to be heard individually, even when \r\ncomplex chords are played.</p>\r\n<h3>2 Point Tremolo</h3>\r\n<p>A 2 point synchronized tremolo provides a great feel when in use and reliably \r\nkeeps you in tune, even with some enthusiastic vibrato use. Add to this the \r\nsteel saddles which aim to add a touch of extra brightness and <strong>help \r\nthose strings sing</strong> and you have a real winner.</p>\r\n<h3>Locking Tuners</h3>\r\n<p>A very welcome upgrade to any guitar, locking tuners not only <strong>\r\nincrease your tuning stability</strong> but also make string changes a breeze. A \r\ngreat quality of life upgrade!</p>\r\n<h2>Who Is It For?</h2>\r\n<p>The contemporary guitarist who likes their guitar to stand out from the \r\ncrowd. It is also packed with a number of excellent features that make it a top \r\nchoice for gigging and touring.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Eye-catching body shape</li>\r\n\t<li>Fireball humbuckers provide a powerful sound</li>\r\n\t<li>Excellent for the gigging musician</li>\r\n</ul>",
