      "<h2>At A Glance: </h2>\r\n<p>The Breedlove Discovery S Concert Edgeburst 12 CE Sitka Spruce/Mahogany is a stunning, compact \r\n12 string acoustic that's a dream for any style of guitarist, with a sound \r\nbigger than the sum of its parts. The Concert model is Breedlove's most \r\npopular, delivering a balance between compact comfort and big body sound that \r\nlends itself superbly to any playing situation. This model features a classic choice of Sitka Spruce top for a guitar with plenty of clarity and projection, and Ecotonewood layered mahogany back and sides.</p>\r\n<p>This 12 string model delivers all the lush roar and chime of a 12 string \r\nguitar, filling any room and mix with that big sound, in spite of this guitars \r\ncomfortable, compact body size.</p>\r\n<p>The Discovery S Concert 12 CE also comes rigged with the superb Fishman Presys I \r\npickup and preamp system. Fishman are rightly well known for their high quality \r\nguitar electronics, so you can be assured of a superb recreation of your \r\nguitar's natural tone.</p>\r\n<p>As a company, one of Breedlove's main focuses is on the ecological impact of \r\nthe materials they use to produce their superb instruments. To this end, they \r\ninsist on several policies as a company including never utilising wood from \r\nclear-cut stock, and only using fallen or sustainably felled trees. The result \r\nis a guitar built with fantastic quality materials without impacting the future \r\nof the environment.</p>\r\n\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Solid Top</h3>\r\n<p>Breedlove guitars all sport sustainably sourced solid wood tops for maximum \r\ntonal character and projection. This model features a handsome Sitka Spruce top. \r\nSolid spruce tops are a classic mainstay of acoustic guitar building, where the \r\nspruce delivers a loud, clear ringing tone with tons of natural projection.</p>\r\n\r\n<h3>Ecotonewood Back & Sides</h3>\r\n<p>Breedlove's Layered Ecotonewood back & sides aren't just the old basic \r\nplywood with a fancy veneer, instead, utilising three layers of sustainably \r\nsourced tonewood. This construction method has been developed by Breedlove to \r\ndeliver all the durability and low-cost-benefits of layered woods, while \r\navoiding the typically soft-center of ply that can dampen tonal response. The \r\nresult is a guitar that's still packed full of superb tone and character, \r\nwithout breaking the bank.</p>\r\n\r\n<h3>Concert Body Shape</h3>\r\n<p>Breedlove's Concert is their most popular body shape, favoured by a host of \r\nplayers thanks to its well balanced and comfortable profile feels compact, but \r\ndoesn't sound it! It generates an articulate tone with plenty low end without \r\nbeing boomy, and lends itself to everything from precise fingerpicking to full \r\non big strums. That balanced tone is even more important when its powering that \r\nclassic big 12-string sound.</p>\r\n\r\n<h3>Who Is It For?</h3>\r\n<p>The player looking for a sustainably built compact 12 string with superb \r\ntone that won't break the bank.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Made from all sustainably sourced materials</li>\r\n\t<li>Classic big 12-string sound in a comfortable body profile</li>\r\n<li>Classic solid Sitka Spruce top with tons of clarity and projection</li>\r\n<li>Ecotonewood Layered Mahogany back & sides</li>\r\n\t<li>Fishman Presys I pickup and preamp</li>\r\n\t<li>Breedlove's powerful yet comfortable Concert body size</li>\r\n</ul>\r\n",
