    description:
      "<h2>At A Glance</h2>\r\n<p>The Cort Gold-A6 Bocote is a stunning acoustic guitar, packed with features \r\nand superb materials at an unbelievable price. </p>\r\n<p>The model gets its name from the striking solid Bocote back and sides. Bocote \r\nis a wood related to Ziricote that sports a handsome grain pattern with a \r\nplethora of light and dark streaks, and a tone akin to rosewood with a <strong>\r\nbig low end</strong> and wide ranging mids. This is paired with a solid Sitka \r\nSpruce top that's undergone Cort's Aged To Vintage torrefaction process that \r\ncaramelises and crystalises the wood's internal structure, opening up and \r\ndeveloping the tone like the passage of time does to a true vintage instrument.</p>\r\n<p>Other fantastic features on this guitar include the superb Fishman Flex Blend \r\npreamp and Sonicore pickup, combining an undersaddle pickup and soundhole \r\nmounted mic, letting you dial in the most accurate recreation of your unplugged \r\nsound. Like all Cort guitars, it also feature's fantastic build quality and \r\nexcellent quality components throughout.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Cort ATV Top</h3>\r\n<p>The Gold-A6 Bocote features a <strong>solid Sitka Spruce top</strong>, \r\ntreated with Cort's Aged To Vintage (ATV) process. This torrefaction process \r\ntakes a brand new piece of wood and treats it to have all the same stunning \r\ntonal characteristics and big, wide open sound of a decades old instrument - \r\nright out the box!</p>\r\n\r\n<h3>Solid Bocote Back & Sides</h3>\r\n<p>This guitar also features solid back and sides made of Bocote. This lesser \r\nutilised tonewood is known for its majestic grain patterns with streaks of \r\nyellow, orange and dark brown through the surface, and is from the same family \r\nas ziricote. Tonally, it boasts a sound similar to rosewood, with a warm, deep \r\nbottom end, broad spectrum of mids and plenty of projection and sustain, making \r\nit the perfect match for the solid ATV Spruce top.</p>\r\n\r\n<h3>Fishman Flex Blend System</h3>\r\n<p>The outstanding Fishman Flex Blend system and Sonicore pickup delivers an \r\nunbelievable recreation of the true acoustic sound of your guitar by blending \r\nthe undersaddle pickup with a soundhole mounted cardioid mic. This blend paired \r\nwith the tone control lets you dial in the perfect sound however you play, from \r\nclear fingerpicking sounds to big strumming or flatpicking. The subtly designed \r\ncontrols sit handsomely and unobtrusively on the top side of the guitar, and the \r\nsystem even features a discreet LED tuner.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>The player looking for an absolutely superb quality acoustic instrument, \r\npacked with features, at an unbeatable price.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Fantastic all-solid wood construction</li>\r\n\t<li>Sitka Spruce top treated with Cort's Aged To Vintage process for \r\n\tsuperior vintage tone</li>\r\n\t<li>Gorgeous and resonant solid Bocote back and sides</li>\r\n\t<li>Fantastic Fishman Flex Blend preamp system</li>\r\n\t<li>Even comes supplied in a hard case</li>\r\n</ul>\r\n",
