    title: "",
    brandName: "Alvarez",
    description:
      "<h2>At A Glance</h2>\r\n<p>The <span>Alvarez Artist Series ABT60CESHB Baritone Electro Acoustic \r\nShadow burst is a fantastic, luxury-feeling acoustic at a very reasonable and \r\naffordable price point. The ABT60CESHB is a baritone acoustic that's tuned from \r\nB to B, giving you a range somewhere between a standard dreadnought and an \r\nacoustic bass, perfect if you're looking for lower tones!</span></p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Solid Top</h3>\r\n<p>Alvarez have constructed this guitar to bring out the true potential of a \r\nsolid top acoustic. Made from Solid A+ Sitka Spruce we have a guitar that's<strong> \r\nrobust and capable of producing an incredible sound</strong>.</p>\r\n\r\n<h3>FST2 Bracing System</h3>\r\n<p>The FST2 is a forward shifted X brace design, and it's a key reason why the \r\nArtist Series guitars sound so good. The forward shifted design places the brace \r\ncloser to the soundhole, which creates a larger soundboard area which makes <strong>each \r\nnote played far more present and substantial.</strong></p>\r\n\r\n<h3>Carefully Curated Process</h3>\r\n<p>Alvarez has been continually improving their guitar design and construction \r\ntechniques for decades, and these refinements are extremely apparent in the\r\n<span>ABT60CESHB. Alvarez uses carefully cured tonewoods of the highest quality, \r\ncomponents such as neck blocks and wood joints are meticulously designed, and the \r\npainting, sanding, and polishing techniques they utilize are undergoing <strong>constant \r\nrefinement to ensure that each guitar is of the highest standard.</strong></span></p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>If you're looking for a versatile acoustic that's made to a very high \r\nquality, and can easily hit some of those lower octaves, then this baritone \r\nguitar is a great choice.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Exceptional Construction</li>\r\n\t<li>Fantastic Sound</li>\r\n\t<li>LR Baggs StagePro Electronics</li>\r\n</ul>",
    productDetail:
      "<p>Tuned from B to B, the ABT60CESHB is pitched between a dreadnought and acoustic bass to give you deep tones with easy playability. Chord shapes and scales are the same as a standard six-string but the voicing is lower. This baritone offers great versatility with its cutaway and LR Baggs StagePro EQ and Element Pickup, and looks fantastic with a stunning shadowburst finish. The ABT60 is one of Alvarez’s best-selling models and within five minutes of owning one you’ll see why. A great guitar to play.</p>",
