    itemName: "GS Mini-e Koa Limited Edition",
    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Taylor GS Mini-e is a compact, versatile instrument. It is slightly smaller than the average acoustic but does it certainly not lack power! It is perfect for everyday use or for taking on the road.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Koa Tonewood</h3>\r\n<p>This Hawaiian grown tonewood is loved for its beautiful caramel coloured grain, <strong>warm character and high-end clarity</strong> that really highlights the nuances of your playing. Koa is unique among tonewoods in that the more you play the guitar, its crisp tones will age, opening up a deep and rich character that continues to improve over time. </p>\r\n\r\n<h3>Versatile Body Size</h3>\r\n<p>The scale length is 23 1/2 inches, making it a little <strong>smaller than a standard acoustic</strong>. This size lends it to a large variety of playing styles and makes it appealing to a great number of players.</p>\r\n<h3>Mini-e Pickup</h3>\r\n<p>This particular model comes pre-fitted with Taylor's own specially created Mini-e pickup. This custom pickup system translates every ounce of tone, detail and dynamic from your fingertips, strings and guitar wood. It gives the audience <strong>an accurate and fully realistic translation of your performance</strong>.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>The player after a smaller sized, comfortable guitar that doesn't sacrifice on quality. With the Taylor name on the headstock you can expect great tone, reliability, and performance. </p>\r\n\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Full, powerful sound despite its slightly cut-down size</li>\r\n<li>Warm, strong tone with a slight natural compression</li>\r\n<li>High quality yet affordable</li>\r\n<li>Comfortable and compact size</li>\r\n<li>Works great as a travel guitar</li>\r\n</ul>\r\n",
