    brandName: "Sigma",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Sigma SDM-STE is an all-solid wood construction acoustic with an <strong>\r\nultra-thin satin finish</strong> to ensure maximum projection of your sound. The \r\nSolid Sitka Spruce top delivers gives this guitar a well rounded, balanced tone \r\nwith a broad dynamic range, while the solid mahogany back and sides impart a \r\npowerful midrange punch with strong fundamental frequencies. The net result is a \r\nclassic combination that ensures every nuance of your playing in any style is \r\nheard loud and clear.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Wood Choices</h3>\r\n<p>The SDM-STE boasts an <strong>all solid wood construction</strong>, with a \r\nsolid sitka spruce top sporting Sigma's ultra-thin satin finish to minimise any \r\ndampening effect from a thick finish to spruce's well rounded tone and broad \r\ndynamic range. Looks great too! This is paired with solid mahogany back and \r\nsides giving your dreadnought style guitar a big sound with plenty of midrange \r\noomph that's perfect for everything from fluid solo lines to big strumming \r\naccompaniment. Ideal, in fact, for flatpickers and bluegrass players.</p>\r\n\r\n<h3>Fishman Presys II Electronics</h3>\r\n<p>The Fishman Presys II preamp offers an unobtrusive system with plenty of \r\nflexibility for your tone. With eq for Bass and Treble, along with a Phase \r\nswitch, master volume, and even a tuner! The Fishman Presys II should have you \r\ncovered for all eventualities.</p>\r\n\r\n<h3>Dreadnought Body</h3>\r\n<p>Dreadnought guitars are built to be commanding. This guitar's dreadnought \r\nbody creates a rich tone with plenty of depth, clarity and character. The larger \r\nbody also makes it great for strumming, giving a consistent volume and even tone \r\nwithout impacting your dynamic range.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Any player looking for the commanding, big sound that only an all-solid \r\ndreadnought can produce. Particularly suited in style to flatpickers and \r\nbluegrass players, but anyone looking for projection and power will love this \r\nguitar.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Solid Spruce top</li>\r\n\t<li>Solid Mahogany back & sides</li>\r\n\t<li>Fishman Presys II preamp</li>\r\n\t<li>Crafted to a very high standard</li>\r\n</ul>",
