    title: "",
    brandName: "G&L",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The G&L Tribute ASAT Classic Tobacco Sunburst Maple Fingerboard delivers on good looks and playability! This ASAT guitar builds on an iconic design to offer a wide range of tones with a world-class playing experience. \r\nUsing a number of innovative design techniques this guitar pushes the boundaries \r\nof what can be done with a T-style model.</p>\r\n\r\n<h2>Features We Love:</h2>\r\n<h3>G&L MFD Pickups</h3>\r\n<p>The Leo Fender designed Magnetic Field Design Single Coil pickups offer individual pole adjustments for acute tonal adjustments. They also use a tighter wind to give \r\n<strong>a warmer sound with a broader frequency response</strong>. </p>\r\n\r\n<h3>Brass Saddles</h3>\r\n<p>With 6 individual brass saddles i<strong>ntonation and string height can be \r\nprecisely set</strong> but you also get the tonal benefit of them being brass \r\ntoo!</p>\r\n<h3>18:1 Ratio Tuners</h3>\r\n<p>A good ratio for tuners is key to them being accurate. <strong>Tuning is \r\nquick and easy</strong> plus they also do a great job along with the fixed \r\nbridge at keeping you in tune too!</p>\r\n<h2>Who Is It For?</h2>\r\n<p>If you like a traditional style guitar but with some modern tweaks then this \r\nsmooth playing model with give you a lot to enjoy. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Classic looks </li>\r\n\t<li>Great for rock, blues and pop</li>\r\n\t<li>Excellent for the gigging musician</li>\r\n</ul>\r\n",
