    brandName: "Solar Guitars",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Solar Guitars A1.6ATG Baritone in Carbon Black Matte has been developed Martin Larsson from legendary Swedish death metal band “At The Gates”. By using the finest design, tonewoods and Fishman Fluence pickups, Solar have created a fantastic looking and ergonomic guitar that's built to sound great and keep sounding great in lower tunings, no matter how hard you play.\r\n\r\n<p>This guitar features a Carbon Black Matte finish that makes this a tasteful take on the extreme guitar and would suit those looking to play aggressive music at high speeds!</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Baritone</h3>\r\n<p>Truly designed for the lowest of riffs this 27\" baritone scale gives you great tension when you're tuning down. No longer will you need mammoth strings when you're tuning down. The extra tension will help you keep string gauges thinner making things easier to play and giving you a sound that isn't as bass heavy. </p>\r\n\r\n<h3>All Access Neck Join\r\n</h3>\r\n<p>Unlike some classic guitars, the A-Series features a contoured cutaway where the neck joins the body which fits your hand as you reach up to the highest frets. The freedom to reach the highest frets without having to reach around the heel of the join matches the rest of the guitar's design that promotes fast and effortless playability.\r\n</p>\r\n\r\n<h3>Fishman Fluence</h3>\r\n<p>Fishman Fluence pickups have been taking the metal world by storm. Manufactured using an innovative process, the Fluence Modern pickups are noiseless, precise and give you two distinct pickup voicings accessible. Bringing a whole new level of versatility to modern tones. \r\n</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Any player after fixed bridge riff machine with a longer scale for those low tunings. All blacked out including the inlay and headstock logo this guitar means business. </p>\r\n\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>27\" scale length retains string tension for lower tunings </li>\r\n<li>The ultimate metal guitar for extreme players!</li>\r\n<li>The fixed bridge offers great tuning stability and is key to the guitar's great sustain\r\n</li>\r\n<li>Fishman Fluence pickups</li></ul>\r\n",
    productDetail:
      "<p>This Type A1.6 Baritone “At The Gates” Artist Series guitar boasts stealth looks, a distinctive cutaway scoop and a remarkable feature set, making it the ultimate, precise and professional instrument of choice for Jonas Stålhammar and Martin Larsson’s stage and studio work. A1.6 Baritone ATG features an original, extremely reliable Hipshot bridge and a pair of Fishman Fluence Modern active humbucker pickups revealing pure, uncorrupted and musical tone. The Type A1.6 features a set-thru neck/body joint design with 26.5” scale, an alder body, a fast and thin comfortable maple neck, an ebony fingerboard with 24 super-jumbo frets and Luminlay ‘glow in the dark’ side dots for easy stage use. Loaded with Grover 18:1 tuners, strap lock style pins, graphite nut, three-way blade switch , push-pull volume knob for voice selection and full access neck</p>",
    salesPrice: 949.0,
