    itemName: "Limited Edition GS Mini-e African Ziricote #2202092324",
    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Taylor Limited Edition GS Mini-e African Ziricote is a compact, versatile instrument. It is slightly smaller than the average acoustic but it certainly does not lack power! It is perfect for everyday use or for taking on the road. </p>\r\n\r\n<p>This <strong>Limited Edition</strong> Ziricote model boasts a unique grain that's destined to age beautifully. </p>\r\n\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Ziricote Tonewood</h3>\r\n<p>Ziricote is regarded as <strong>one of the most beautiful tonewoods</strong> available, with a stunning assortment of colours that intertwine in a truly unique way. The Ziricote back and sides really make this guitar stand out from the rest.  Ziricote has a tonal character similar to Rosewood and is key to the guitar's beautifully crisp tone. </p>\r\n\r\n<h3>Versatile Body Size</h3>\r\n<p>The scale length is 23 1/2 inches, making it a little <strong>smaller than a standard acoustic</strong>. This size lends it to a large variety of playing styles and makes it appealing to a great number of players.</p>\r\n\r\n<h3>Taylor Electronics</h3>\r\n<p>Designed after Taylor's renowned \"Expression System 2\" pickup the ES-B also features an \r\n<strong>on-board digital tuner</strong> and LED display for maximum ease of use. With Taylor's reputation of great-sounding pickups you can feel comfortable in its tone and reliability.\r\n\r\n</p>\r\n<h2>Who Is It For?</h2>\r\n<p>The player after a smaller sized, comfortable guitar that doesn't sacrifice on quality. With the Taylor name on the headstock you can expect great tone, reliability, and performance. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Unique Limited Edition model</li>\r\n<li>Full, powerful sound despite its slightly cut-down size</li>\r\n<li>Warm, strong tone with a slight natural compression</li>\r\n<li>High quality yet affordable</li>\r\n<li>Comfortable and compact size</li>\r\n<li>Works great as a travel guitar</li>\r\n</ul>\r\n",
