    title: "",
    brandName: "Sheeran by Lowden",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Sheeran by Lowden S Shape Equals Signature Edition has been finely crafted to be a true performers guitar. Mr Sheeran needs \r\nno introduction, having gained a huge dedicated following of fans the world over \r\nthanks to his skilled songwriting and captivating performances. What's more, he \r\ncontinues to inspire musicians with his down to earth attitude and love of \r\nmusic, so what better way to celebrate his new album than with this special \r\nSignature Edition model!</p>\r\n<p>It has been made to a very high standard and the S body size makes it very comfortable to play while still having a big sound. <strong>Limited to only 3000 worldwide</strong> \r\nand with the following Ed Sheeran has, you better be quick if you are keen on \r\nadding this to your collection!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Wood Pairing</h3>\r\n<p>The choice of woods for the Equals Signature Edition give this guitar a \r\nspecial quality. It benefits from stunning figured walnut back and sides and a \r\nSitka spruce top. Not only does this provide a natural look with heaps of charm \r\nbut produces <strong>a well-defined tonal quality</strong> that oozes with \r\ncharacter, making it very rewarding to play and a joy to hear!</p>\r\n<h3>Gorgeous Details</h3>\r\n<p>Several special components come together to give the Equals its own look \r\nwhile still keeping a good amount of the classic Sheeran by Lowden aesthetic. \r\nThe <strong>maple \"=\" inlay on the 7th fret</strong> ties in with Ed's latest \r\nrelease. An intricate Butterfly can be found on the truss rod cover with another \r\nadorning the heel cap, all mirroring the theme of the artwork. It also features \r\nthe special custom label inside the guitar, signifying its limited edition \r\nstatus. </p>\r\n<h3>LR Baggs EAS VTC</h3>\r\n<p>As any fan of Ed Sheeran will already know, acoustic live performance is \r\nwhere a guitar really needs to rise to the occasion. Fitted with the LR Baggs \r\nEAS VTC pickup system, this guitar has no problem producing <strong>a balanced \r\nsound with excellent string articulation</strong> when plugged in. Be it in the \r\nstudio or on stage, the Equals is ready for the task.</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>If you're an Ed Sheeran fan you can't go wrong with this. Additionally, if you're simply looking for a great acoustic for live performances you can't go wrong with this stunning instrument. Designed with Ed himself, he knows a thing or two about what makes a great live performance acoustic. </p>\r\n\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Limited to only 3000 worldwide</li>\r\n\t<li>Finely crafted from great wood choices</li>\r\n\t<li>Ready for a life of performance and recording</li>\r\n\t<li>Features several details inspired by the album artwork</li>\r\n</ul>",
