    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Taylor BBTe Left Handed is a versatile guitar featuring quality tonewoods, Taylor's X Bracing system and their Expression System 2 pickup. The Big Baby Taylor is a 15/16-size Dreadnought body guitar, providing that big tone in a portable instrument. Designed for the guitarist on the go, or a newer player who wants to start off with a quality instrument. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Quality Woods</h3>\r\n<p>The BBTe has Layered Walnut back and sides, this wood boasts rich brown hues that look great as well as adding general warmth to the guitar's tone. The Sitka Spruce top brings produces a broad dynamic range that's accommodating to a wide range of playing styles. Finished off with an Ebony fingerboard and Taylor have made sure <strong>this model receives the same attention as their higher end models</strong>. </p>\r\n<h3>X-Bracing</h3>\r\n<p>Taylor's X-Bracing system provides <strong>a continuous flow of strength throughout the body</strong> of the guitar and provides top wood rigidity in spite of the soundhole's location in the middle of the soundboard. \r\n</p>\r\n<h3>ES-B 1.2 Pickup System</h3>\r\n<p>The custom ES-B pickup system has been designed to transparently capture the natural tone of the guitar, plus gives you 3-Band EQ controls to fine-tune your tone and features a \r\n<strong>built-in chromatic tuner</strong>, so you're ready to stay in tune without needing to carry extra equipment with you. \r\n</p>\r\n<h2>Who Is It For?</h2>\r\n<p>Any player after a portable guitar but still looking for quality. Even newer players who are looking for reliable quality in an easy to handle package can find this to be a great guitar. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Great sound produced by quality woods and Taylor electronics</li>\r\n<li>Taylor Big Baby body shape</li>\r\n<li>Suited to a wide variety of playing styles and musical genres</li>\r\n</ul>\r\n\r\n",
