      "<p>Washburn’s Comfort Series combine looks and ergonomics to deliver the ultimate player-friendly guitars. With their armrest bevel, these guitars hug the body rather than digging into it and provide a comfortable playing experience whether you’re sitting or standing.</p>\r\n\r\n<p>The G20SCE is a Grand Auditorium style acoustic/electric guitar that features a book matched solid Sitka spruce top whose tone will improve with age, supported by Quarter Sawn Scalloped Sitka Spruce bracing, Pau Ferro back and sides, a cutaway for superior upper fret access and premium Fishman Presys II 301T electronics for natural amplified acoustic tone. The unique feature of this model is the mahogany ergonomic armrest bevel binding on the lower bout that provides the comfort the series gets its name from by removing the harsh angle that would normally cut into your forearm. Other features are the mahogany neck with Ovangkol fingerboard and bridge.</p>\r\n\r\n<p>The G20SCE is a fantastic sounding acoustic guitar on its own but the addition of premium Fishman electronics makes for an outstanding stage performance guitar. The Fishman® Presys II 301T is an integrated tuner/preamp system for versatile amplified tonal shaping.</p>",
