    description:
      "<h2>At A Glance: </h2>\r\n<p>The Alvarez Artist Series AD30CE is a Dreadnought sized acoustic with a \r\nhelpful cutaway. Larger body sizes such as this often make the upper frets hard \r\nto access but this gives you the best of both worlds! It is also fitted \r\nwith some next level features not found on most guitars at this price point such \r\nas a solid top and a real bone nut. Add in the Sys250 pickup for extra \r\nversatility and you have a guitar that performs out with its very modest price \r\npoint!</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Materials</h3>\r\n<p>The AD30CE sports laminate mahogany back & sides, providing a reliable and \r\nrobust construction that stands up to the rigours of the road, paired with a \r\nsolid A Sitka spruce top to deliver great tone and superb projection.</p>\r\n<h3>Electronics</h3>\r\n<p>The AD30CE features the Sys250 pickup, letting you amp up for bigger live \r\nsituations and making it a great choice for the recording musician too.</p>\r\n<h3>Dreadnought Body Shape</h3>\r\n<p>The dreadnought is a hugely popular body size as it produces a large sound \r\ncapable of filling almost any room! With plenty of low end, it can really fill \r\nout a performance and adds an extra depth to songs.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>For this price you'd be hard pushed to find a guitar that has such high \r\nquality specifications</li>\r\n\t<li>Benefits from electronics and a smooth cutaway</li>\r\n\t<li>A solid Sitka spruce top that will stand the test of time</li>\r\n</ul>\r\n\r\n\t\r\n\r\n\r\n",
    productDetail:
      "<p>The AD30 is Alvarez's entry-level solid top acoustic guitar, but it’s anything but entry-level in terms of quality, tone and finish. Incredible sound and value. This acoustic electric model is fitted with their B-BAND SYS250 EQ with built-in backlit tuner.</p>\r\n\r\n<p>The Artist Series AD30CE is designed to get the best out if its components, and for them to work together to produce balance, lively projection and great response. These components include the FST2 bracing system, bi-level rosewood bridge, real bone nut and saddle, great quality tone woods and thin finish.\r\n</p>",
