    asn: "",
    category: "GUEG_1",
    online: true,
    itemName: "Standard Series Espada Gloss Black (Ex-Demo) #IW21070114",
    title: "",
    brandName: "Balaguer",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Espada is a striking example of USA design. An offset model with the modern guitarist in mind, the Espada features high output pickups, locking tuners and a lightweight alder body, resulting in a no-nonsense guitar that looks as beautiful as it sounds. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Hardware</h3>\r\n<p>From the Standard Series all the way up to the custom shop Heritage Series, every Balaguer guitar features the same high quality hardware. Meaning even their lower-priced guitars offer exceptional value for money! Even the included gig bag is made to a high standard, with a rigid inner padding, removable neck support and 2 Adjustable Padded Shoulder Straps.</p>\r\n\r\n<h3>Quality Assured in the USA</h3>\r\n<p>Each and every Balaguer guitar undergoes a full quality assessment and set up at their HQ in Pennsylvania, USA, ensuring you receive a guitar that meets their high standards straight out of the box.</p>\r\n\r\n<h3>Pickups</h3>\r\n<p>Balaguer’s own pickups are designed for the modern player. The high output \r\nFeral Alnico V magnet humbucker in the bridge brings depth and texture to a tight humbucking sound that’s suitable for rock, metal and anything else that demands a rich singing sustain. \r\nThe Austral Singlecoil in the neck position delivers that unmistakable twang and \r\nsnap of a country-style singlecoil pickup, pairing wonderfully against the \r\nbridge humbucker.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>High quality hardware and build quality</li>\r\n<li>Locking tuners</li>\r\n<li>High output pickups</li>\r\n<li>Comes with high quality gig bag making sure you're road ready</li>\r\n",
    productDetail:
      "<p>The Espada is Balaguer's take on the offset guitar, evolved. The brand new \r\nStandard Series Espadas are built with premium specs such as Stainless Steel \r\nFretwire, Roasted Maple Necks, and Locking Tuners.</p>\r\n",
