    brandName: "Epiphone",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Epiphone J-45EC Studio Ebony delivers a high quality Dreadnought guitar at an affordable price. Every step of this guitar has been designed with care, from the cutaway body that allows for easy higher fret access, to the extremely comfortable neck profile and high-quality Fishman pickup system, which all ensure the J-45EC is ready to grow with you as you develop as a player. </p>\r\n\r\n<h2>Features We Love:</h2>\r\n\r\n\r\n<h3>Dreadnought Body Shape</h3>\r\n<p>The dreadnought is <strong>a hugely popular body size </strong>as it produces a large sound \r\ncapable of filling almost any room! With plenty of low-end, it can really fill \r\nout a performance and adds an extra depth to songs. This model features a cutaway in the body that allows for easy access to the higher frets. </p>\r\n\r\n<h3>SlimTaper Neck Shape</h3>\r\n<p>The SlimTaper™ D-Shape promotes comfort without feeling too thin in your hand, which makes it \r\n<strong>ideal for beginners </strong>and players with smaller hands. </p>\r\n\r\n\r\n<h3>Fishman Presys-II Pickup System</h3>\r\n<p>The built-in Fishman pickup eliminates the need for using a microphone on the guitar in a live setting, \r\n<strong>simply plug into the PA and you're ready to go</strong>. The pre-amp features an intuitive set of controls including bass and treble that's handy for dialling out feedback, plus a tuner, which means you're always ready to stay in tune in every situation. </p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>This model will appeal to beginners who are looking for a guitar that is able to last as they develop as a player, and experienced players who are looking for a high-quality yet affordable option. </p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Ideal for new and younger players</li>\r\n<li>Comfortable neck</li>\r\n<li>High quality fishman pickup system</li>\r\n</ul>\r\n",
