    description:
      "<h2>At A Glance</h2>\r\n<p>The Violet Gc-SM Masters Choice Sitka Spruce / African Mahogany sees this model \r\nelevated to new heights. Furch have updated their previous Violet Series models \r\nand they now come with solid woods for an even better sound and look! Along with \r\ntheir superb levels of craft and quality materials, you get a guitar that is a \r\njoy to play and sounds like the premium instrument it is. It has a stylish look \r\nand a full voice that will give plenty of projection and detail.</p>\r\n<p>The Violet Master's Choice models also come fitted with the LR Baggs StagePro \r\nElement system, with its side-mounted preamp and built-in tuner.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Solid Top, Back and Sides</h3>\r\n<p>The character and quality of an acoustic guitar depends massively on the \r\nwoods used. With a carefully selected solid Sitka spruce top and solid African \r\nmahogany back and sides, this is a guitar with a <strong>premium well-balanced \r\nsound</strong>.</p>\r\n\r\n<h3>Open-Pore Finish</h3>\r\n<p>Not only does this give the guitar a very natural appearance but it also\r\n<strong>allows the guitar to breathe</strong>. It is enough to protect the \r\nsurface of the guitar but thin enough to allow its organic tone character to \r\nshine through.</p>\r\n\r\n<h3>Furch CNR System</h3>\r\n<p>This neck design features a high precision, dual-action truss rod for <strong>\r\nexcellent stability and easy adjustments</strong> when needed. This gives you \r\npeace of mind that you can always have this instrument setup to play at its \r\nbest,</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>Guitarists looking for a finely crafted traditionally influenced acoustic \r\nthat has been updated for the modern player.</p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Carefully selected solid woods</li>\r\n\t<li>Strong and well-voiced sound</li>\r\n\t<li>Great choice for working/professional guitarists</li>\r\n</ul>",
