    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance:</h2>\r\n<p>The Taylor Academy 10e is a fantastic dreadnought acoustic, designed to be comfortable and very easy to play. It features high quality yet affordable materials, making it great value for money.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Comfortable, Bevelled Armrest</h3>\r\n<p>The guitar has a bevelled armrest for added comfort. This feature is usually reserved for the absolute top-end Taylor guitars. It’s a refreshing and bold move to include it on such an affordable model!</p>\r\n<h3>Quality, Affordable Materials</h3>\r\n<p>The 10e is made with a solid Sitka Spruce soundboard and an Ebony fingerboard. Taylor have ensured that the most important elements to playing - sound, feel and comfort - are the number one priority. Costs are kept down by using layered Sapele for the back and sides, and by keeping the finish Matte. Instead of extra decorative elements, a simple sound hole rosette and dot inlays are used.</p>\r\n<h3>ES-B 1.2 Pickup System</h3>\r\n<p>The custom ES-B pickup system has been designed to transparently capture the natural tone of the guitar, plus gives you 3-Band EQ controls to fine-tune your tone and features a \r\n<strong>built-in chromatic tuner</strong>, so you're ready to stay in tune without needing to carry extra equipment with you. \r\n\r\n</p>\r\n\r\n<h2>Who Is It For?</h2>\r\n<p>They player after a comfortable and quality acoustic with signature Taylor guitars reliability and tone. </p>\r\n\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Comfortable to play thanks to bevelled armrest</li>\r\n<li>Great value for money</li>\r\n<li>Very easy to play, with a slightly shorter than average scale length</li>\r\n</ul>\r\n",
    productDetail: "",
