    itemName: "SE Custom 22 Semi Hollow Santana Yellow (Ex-Demo) #CTID48872",
    title: "",
    brandName: "PRS",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The PRS SE Custom 22 Semi Hollow Santana Yellow delivers quality and affordability in a concise package. With it's semi hollow body and the positioning of the neck humbucker on this 22 fret model you have access to plenty of sweet warm tones. Though with the 85/15 S pickups you can still get plenty of biting bright tones. All round this is a great choice for musicians of any level, not only does this PRS provides some gorgeous tones, the Santana Yellow looks stunning over the Flame Maple. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n<h3>85/15 S Pickups\r\n</h3>\r\n<p>The first two numbers of the pickups name indicate the year that the original pickup came out. The last two digits denote what year that pickup design was reissued with modern enhancements. The pickups mounted in this guitar are \r\n<strong>based on the pickups loaded in the first PRS guitars</strong>. The earlier pickups' tolerance variations have been shrunk to unnoticeable differences in sonic output by utilising new computer programmable machinery. PRS aim to keep improving their innovations as new technology develops.   \r\n</p>\r\n<h3>Wide Thin Neck\r\n</h3>\r\n<p>The neck is where most of the playability of the guitar is decided. PRS have thought meticulously about the shape and feel of the necks they offer. This guitar sports a Wide Thin neck. This neck gives you a thin profile with a wide fretboard, \r\n<strong>a combination championed by fast players</strong>. The maple neck is given a gloss finish and is capped with a rosewood fretboard.  \r\n</p>\r\n<h3>Coil Split\r\n</h3>\r\n<p>The push/pull coil split is located within the tone control. The added function allows you to split both humbuckers resulting in \r\n<strong>six different tonal possibilities</strong>. If you are looking for an instrument that sounds good in almost any musical scenario, this wiring mod should be a welcome sight.  Not compromising tone, the pickups have been crafted for optimum sound in both standard and split positions.  \r\n</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Coil splittable 85/15 S pickups for versatile tonal output</li>\r\n<li>Thick maple cap with flame maple veneer gives you the sonic and visual benefits at a more affordable price.</li>\r\n<li>PRS designed hardware makes for a reliable instrument.\r\n</li>\r\n</ul>\r\n\r\n",
    productDetail:
      "<P>The PRS SE Custom 22 Semi-Hollow has musical midrange and outstanding resonance. The semi-hollow body provides an airy, sweet tone but with a twist of the tone knob, the dual humbuckers can get plenty of bright spank. Additional appointments include a maple top, mahogany back and neck, rosewood fretboard, and dual 85/15 “S” pickups with volume and push/pull tone controls (for coil tapping) paired with a 3-way blade pickup selector. 85/15 “S” pickups lend remarkable clarity and extended high and low end to this semi-hollow’s voice.</P>\r\n<P>The SE Custom 22 Semi-Hollow is both versatile and comfortable, making it a reliable tool for professionals, a solid choice for beginners, and a welcome addition to any arsenal.</P>\r\n",
