    itemName: "OM-240CE Dark Blue Burst",
    title: "",
    brandName: "Guild",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The Guild OM-240CE Dark Blue Burst is a great all-rounder and a lot of fun to play. \r\nConstructed from Sitka spruce and mahogany, the OM-240CE takes its cues from \r\nGuild's rich heritage of the 60's. Stylish and very easy to play, the inviting \r\nnature of this guitar will have you coming back for more. It also has \r\nelectronics on hand for an easy time playing live and recording.</p>\r\n<h2>Features We Love:</h2>\r\n<h3>Wood Pairing</h3>\r\n<p>A tried and tested favourite, the solid Sitka spruce top is paired with \r\nmahogany back and sides for <strong>a warm and balanced sound</strong>. On top \r\nof this, the OM body shape means it is just as good for fingerpicking as it is \r\nfor strumming.</p>\r\n<h3>Guild/Fishman Electronics</h3>\r\n<p>The OM-240CE features a Guild/Fishman Sonitone GT-1 with Volume and Tone \r\ncontrols that allow for <strong>full control of adjustments</strong> over the \r\nsound captured by the AP-1 pickup. </p>\r\n<h3>Arched Back</h3>\r\n<p>The arched mahogany back is very comfortable for both seated and standing \r\npositions. It also gives <strong>a good degree of projection</strong> and keeps \r\nthe guitar to a lighter weight seeing as no back braces are needed for this \r\ndesign.</p>\r\n<h3>Who Is It For?</h3>\r\n<p>For players who are looking for a very reliable and well-made acoustic \r\nguitar, that is very reasonably priced. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Excellent levels of craft</li>\r\n<li>Electronics make live performance easy</li>\r\n<li>Great for those who play many styles</li>\r\n</ul>",
    productDetail:
      "<p>This mid-sized orchestra-shaped acoustic is equally suited for strumming and fingerpicking and produces a sweet, balanced tone. The perfect choice for the versatile musician, the OM-240CE features a solid Sitka spruce top, mahogany sides, and arched mahogany back. Guild’s signature arched back design allows for great volume and projection, long sustain, and a lush, full sound. The OM-240CE in Dark Blue Burst features Guild’s AP-1 pickup, a bone nut and saddle, pearloid rosette, period-correct tortoiseshell pickguard, and a matte polyurethane finish.</p>",
