    itemName: "GS Mini-e Koa #2210301200",
    title: "",
    brandName: "Taylor",
    description:
      "<h2>At A Glance</h2>\r\n<p>The Taylor GS Mini-e is a compact, versatile instrument. It is slightly smaller than the average acoustic but it certainly does not lack power! It is perfect for everyday use or for taking on the road.</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Koa Tonewood</h3>\r\n<p>This Hawaiian grown tonewood is loved for its beautiful caramel coloured grain, warm character and high-end clarity that really highlights the nuances of your playing. Koa is unique among tonewoods in that the more you play the guitar, its crisp tones will age, opening up a deep and rich character that continues to improve over time. </p>\r\n\r\n<h3>Versatile Body Size</h3>\r\n<p>The scale length is 23 1/2 inches, making it a little smaller than a standard acoustic. This size lends it to a large variety of playing styles and makes it appealing to a great number of players.</p>\r\n<h3>Mini-e Pickup</h3>\r\n<p>This particular model comes pre-fitted with Taylor's own specially created Mini-e pickup. This custom pickup system translates every ounce of tone, detail and dynamic from your fingertips, strings and guitar wood. It gives the audience an accurate and fully realistic translation of your performance.</p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Full, powerful sound despite its slightly cut-down size</li>\r\n<li>Warm, strong tone with a slight natural compression</li>\r\n<li>High quality yet affordable</li>\r\n<li>Comfortable and compact size</li>\r\n<li>Works great as a travel guitar</li>\r\n</ul>\r\n",
    productDetail:
      "<p>This alluring all-koa version of the GS Mini pairs a solid koa top with layered koa back and sides, serving up an inspiring blend of looks, feel and sound. The compact Mini’s scaled-down design delivers ultra-portability for players on the go and couch-friendly comfort for picking at home, while the rich, full voice belies its size. Our patented neck design guarantees signature Taylor playability, and the shorter 23.5-inch scale length makes forming a chords a breeze. Onboard ES-B electronics invite you to plug in whenever you're ready, and feature a convenient built-in digital chromatic tuner with an LED display for tuning and low battery indication. \r\n\r\n</p>",
