    title: "",
    brandName: "Alvarez",
    description:
      "<h2>At A Glance: </h2>\r\n<p>The MGA70WCEARSHB Masterworks Elite from Alvarez combines quality craftsmanship, materials \r\nand design to create a beautiful sounding Grand Auditorium acoustic that plays great. \r\nIt's a traditional looking guitar with a beautiful Shadowburst finish and an LR Baggs pickup system. \r\nThis Masterworks acoustic will always sound beautiful and would be an ideal \r\ninvestment for beginners or as a reliable gigging guitar for advanced players. \r\n</p>\r\n<h2>Features We Love:</h2>\r\n\r\n<h3>Alvarez Masterworks</h3>\r\n<p>Alvarez have been one of the leading acoustic brands for nearly 50 years, with an image that's synonymous with quality and innovation. Their Masterworks range has been developed to offer the best possible quality at an affordable price. By taking their time to craft each instrument, Alvarez take pride in presenting you an \r\nacoustic guitar that will keep calling you back to play.</p>\r\n\r\n<h3>Grand Auditorium Shape</h3>\r\n<p>Not as large as a Dreadnought, Grand Auditorium guitars can be more comfortable for smaller players \r\nand learners, but still retain the volume and clarity of a large body acoustic. \r\n \r\n</p>\r\n\r\n<h3>LR Baggs VTC</h3>\r\n<p>The guitar is equipped with an LR Baggs VTC pickup system, which offers an accurate and transparent capture of the guitar's tone. The controls for the pickup are hidden inside the edge of the soundhole, meaning that there are no unsightly control panels on the body of the guitar. It has the appearance of a traditional acoustic guitar, with all of the benefits of a modern electro-acoustic, truly the best of both worlds. </p>\r\n<h2>Highlights:</h2>\r\n<ul>\r\n<li>Quality build quality makes this a really enjoyable instrument to play</li>\r\n<li>Grand Auditorium body gives great volume and tone and will feel comfortable for beginners</li>\r\n\t<li>Pickup system will make gigging easy</li>\r\n</ul>\r\n",
